INSERT INTO `cmschanges` VALUES (1,'Fieldvalue4/5 til komponenter','2004-04-27 00:00:00','HJO','fieldvalue4 og fieldvalue 5 til hvert element man tilføjer. Man kan nu indtaste flere options til hver component.','fieldvalue4, fieldvalue5 tilføjet til tabellen: cmsrowtyperel:\r\n\r\n	alter table cmsrowtyperel\r\n	 add column  fieldvalue4 varchar(255) null after fieldvalue3\r\n	,  add column  fieldvalue4 varchar(255) null after fieldvalue4\r\n	, type=MyISAM\r\n\r\nfieldvalue4, fieldvalue5 tilføjet til tabellen: pageelement:\r\n	alter table pageelement\r\n	 add column  fieldvalue4 varchar(255) null after fieldvalue3\r\n	,  add column  fieldvalue5 varchar(255) null after fieldvalue4\r\n	, type=MyISAM\r\n\r\nfieldvalue4, fieldvalue5 tilføjet til tabellen: cmsrowfieldtype:\r\n	\r\n	alter table cmsrowfieldtype\r\n	 add column  desc4 varchar(255) null after desc3\r\n	,  add column  desc5 varchar(255) null after desc4\r\n	, type=MyISAM','modules/tables/elements_admin.php\r\nschemes/default/templates/element_admin.tpl\r\nmodules/tables/admin.php\r\nmodules/tables/elements.php\r\nmodules/tables/lista.php\r\nmodules/tables/listb.php\r\nmodules/tables/edit_lista.php\r\nimages/plus_open.gif\r\nimages/plus_closed.gif\r\n',0,1),(2,'Multiple_element med tuksi tag og tablelayout','2004-04-27 00:00:00','HJO','1) Man kan nu lave tuksi tag ved at sætte 1 i fieldvalue5\r\n2) Tablelayout ID i sættes i fieldvalue4.\r\n3) Bedre validering af indtastet options.','','modules/tables/fieldtypes/multiple_element.inc',0,1),(13,'dato kan sÃ¦ttes til now() som default i date og datetime','2004-04-14 00:00:00','ALE','Gælder for Date og Datetime\r\n\r\nDatoen kan nu sættes til at være now() som default ved at sætte fieldvalue2 = 1.\r\nDerudover er default værdierne for år,måned og dag ændret til \'-\' istedet for 0.','ingen','date_types.inc \r\nklasserne fieldDate og fieldDatetime',0,1),(14,'TUKSI tekst editor','2004-04-27 00:00:00','mbo','','Har tilføjet et replace kald, der ved brug af IE, erstatter alle breaks <br> med </p><p>. Foran skrives et <p> og bagest skrives et </p>','/modules/tables/fieldtypes/htmleditor/script/editor.js',0,1),(15,'Fileupload komponent Ã¦ndret','2004-05-05 00:00:00','HJO','Man kan nu \"upload\" lokale filer. \r\nFieldvalue 2: Ved at skrive en path til en folder, man man få en selectbox med filer i folderen. Iforhold til CMS folder f.eks \"ftpupload\".','','modules/tables/fieldtypes/fileupload.inc',0,1),(16,'Fejl i multipleelements og XCheckbox from other table','2004-05-05 00:00:00','HJO','\'XCheckbox from other table\' virkede slet ikke.\r\nmultipleelements kunne ikke have to i samme edit.','','modules/tables/fieldtypes/standard_types.inc\r\nmodules/tables/fieldtypes/multiple_element.inc',0,1),(17,'Stylesheet Ã¦ndret','2004-05-12 00:00:00','HJO','','','schemes/default/stylesheet/tuksi.css',0,1),(18,'standardpage.tpl Ã¦ndret','2004-05-12 00:00:00','HJO','','','schemes/default/templates/standardpage.tpl',0,1),(19,'lista.tpl Ã¦ndret','2004-05-12 00:00:00','HJO','','','schemes/default/templates/lista.tpl ',0,1),(21,'Fejl rettelse i modules/tables/edit.php','2004-05-25 00:00:00','HJO','','','modules/tables/edit.php',0,1),(20,'X checkbox - nu med condition','2004-05-14 00:00:00','BLA','Nu er det muligt at sætte et feltnavn (fieldvalue3) som datatabellen samt hovedtabellen knytter sig til. \r\nSe hvordan under test>edit-lista test','','standard_types.inc',0,1),(22,'TUKSI tekst editor - problem med breaks efter lister I IE, samt dÃ¸de breaks.','2004-06-07 00:00:00','MBO','Hvis der benyttes IE, indsættes efter alle lister (både UL og OL),  et <p>-tag. Mao erstattes regex\'et \"/(<\\/[uo]l[^>]*>)/gi\" med \"$1<p>\".\r\n\r\nIE har en tendens til at indsætte \"døde\" breaks, dvs. \"<p></p>\"(gør ingenting) isf. \"<p> </p>\" (der opfører sig som et <br>). \r\nDer er nu til føjet et replace-kald således at der ikke optræder døde breaks.','','/modules/tables/fieldtypes/htmleditor/script/editor.js',0,1),(23,'Seq i multible element','2004-06-02 00:00:00','ALE','Har opdateret multible element således at den nu tager felterne fra den nye tabel i den seq der er sat i tablelayoutet.\r\n','ingen','/modules/tables/fieldtypes/multiple_element.inc i getHTML() fra linie 155',0,1),(24,'list.tpl Ã¦ndret lidt','2004-06-07 00:00:00','HJO','Design ting.','','schemes/default/templates/list.tpl',0,1),(26,'Tuksi Tekst editor Mozilla/Mac hack','2004-06-24 00:00:00','mbo','Har foretaget rettelser i felttypen \'multiple_element\' for at få Tekst Editoren til at fungere i Mozilla og Firebird Mac.\r\nProblem:\r\nVed Tuksi i Mozilla både på PC og Mac. Tekst-editor-felter inde i mutiple-elements kunne hverken tilgås eller benyttes, og indeholdt intet data. Ved gemning slettedes alt data i den tilhørende post i databasen.\r\nLøsning:\r\nFor hvert multiple-element, oprettes, i javascript, et array af alle de editor-felter(deres id\'s), der ved åbning og lukning af de respektive multi-elementer, aktiveres alle editor-felter i det element. Multiple-elements er således knyttet til editoren(hvis der findes nogle editor-felter)','','/home/dwarfdk/tuksi.test/javascript/tools.js: added obj_exists()\r\n/home/dwarfdk/tuksi.test/modules/tables/fieldtypes/htmleditor.inc\r\n/home/dwarfdk/tuksi.test/modules/tables/fieldtypes/htmleditor/templates/editor.tpl\r\n/home/dwarfdk/tuksi.test/modules/tables/fieldtypes/htmleditor/script/editor.js\r\n/home/dwarfdk/tuksi.test/modules/tables/fieldtypes/multiple_element2.inc',0,1),(25,'JPG kvalitet i billededitor','2004-06-08 00:00:00','dwh','Der er ændret i billededitoren så der til JPG-billeder kan sættes kvalitet ( 100x100x75 ). Her er 75 kvaliteten. Sættes kvaliteten ikke er den default 100.','','picture_cropper.inc',0,1),(27,'Enum select','2004-07-30 00:00:00','mbo','Tuksi kan nu håndtere typen \'enum\' fra MySQL tabeller.\r\nDer laves en select med alle de options der findes i en given enum i en given tabel.','Tilføjet en post i  cmsrowfieldtype','/modules/tables/fieldtypes/enum_select.inc',0,1),(28,'TUKSI knapper','2004-08-16 00:00:00','HJO','Man kan nu lave sine egne knapper i et TUKSI script.\r\n\r\nVed at lave et array, som array(\"NAME\" => \"BTNDEBUG\", \"VALUE\" => \" Debug \").\r\n\r\n$ctlPage->addButton($TUKSI->MakeButtons(\"BUTTONSAVE\", array(\"NAME\" => \"BTNDEBUG\", \"VALUE\" => \" Debug \")), 1);','','tuksi.lib',0,1),(29,'fieldCMSUpload Ã¦ndret','2004-08-23 00:00:00','HJO','Man kan nu uploade direkte fra en FTP mappen.','','',0,1),(30,'TilfÃ¸j i edit mode','2004-08-25 00:00:00','HJO','Man kan nu tilføje ny række, mens man editere en anden række.\r\n\r\n','','modules/tables/edit.php\r\nmodules/tables/fieldtypes/standard_types.inc\r\n',0,1),(31,'Ny felttype i TUKSI: MD5 Sum','2004-09-07 00:00:00','mbo','Som navnet antyder er her tale om et felt der gemmer den indtastede streng som en MD5 sum - oplagt til passwords.\r\nFieldvalue1 - Kan indeholde en key, der bliver indsat foran strengen _inden_ MD5, fx. \"TUKSI_\".\r\nFieldvalue2 - Kan indeholde den masimalt tilladte længde af strengen, fx. \"10\".\r\nFieldvalue3 - Evt. regulært udtryk i PCRE, der definerer tilladte tegnvariationer i strengen, fx \"/^[A-Za-z0-9_-]*$/\".','Tilføjet post i cmsrowfieldtype, id 35, med beskrivelse til fieldvalue1,2 og 3. samt klassenavn','/modules/tables/fieldtypes/md5sum.inc',0,1),(32,'Lidt forsinket: Nyt i tuksi_template2','2004-09-07 00:00:00','mbo','1. Der kan nu defineres standardblokke til SHOWs. De skal navngives ligesom de tilhørende SHOW, blot med prefikset NO, dvs: SHOW_START_PPP har standard-show: NOSHOW_START_PPP.\r\n\r\n2. Fremover _kan_ metoden AddShow kaldes med, indtil videre, 2 argumenter. Første er, som altid, navnet på den SHOW der skal vises, argument 2 værdien på en variabel med samme navn som SHOW. \r\n\r\n','-','tuksi_template2.lib',0,1),(33,'Opdateret tabs','2004-10-28 00:00:00','Anders el Lemholt','Det er nu muligt selv at definere bredden af tabs fro et tree id. Default er 73 men hvis teksten bliver for lang ryger grafik hel i smadre så nu kan man tilpasse bredden. Derudover er der rettet en lille fejl der gjorde at hvis man tilnyttede et ROWID til et tab fik alle de andre tabs samme rowid.','cmstree -> tabwidth(int)','cmstree.php\r\nedit.php\r\nstandard_tpl_content.inc',0,1),(34,'NB - Omfattende script Ã¦ndringer pÃ¥ tuksi.test','2004-11-25 00:00:00','dwh','Der er i tuksi objektet lavet en funktion til at sammensætte Querystrings. \r\nStort set alle scripts er ændret til at bruge funktionen.\r\n\r\nDen sætter selv nødvendige variabler i querystringen. Til viderførsel til forskellige scripts.\r\n\r\nSupporterer: ROWID, TREEID, TABID, TID\r\n\r\nØnskes variabler overskrevet eller tilføjel kaldes funktionen med \"overrule\"/tilføj variabler i et array\r\n\r\nFX. \r\nqueryBuilder(array(\"ROWID\" => 2, \"TABLENAME\" => \"test\"));','','',0,1),(35,'Pageemelents bindes nu pÃ¥ tabid og ikke pÃ¥ treeid','2004-11-25 00:00:00','dwh','For at kunne have flere elements pr. tab er elements blevet ændret.\r\npageelements bruger tabid.\r\nfrontend tunktionerne load_pageelements() & load_siteelements() er ændret således at hvis de modtager et treeid med flere elements i tabs. Så sættes variablerne i fx. $TUKSI->page->tabs[#tabid#]->#variableer#, er der kun et sæt elements i en tab retruneres varialberne stadig på samme måde. \r\n\r\nNB! se mulighederne i frontendfunktionerne  load_pageelements() & load_siteelements().\r\n\r\n ','pageelements: cmstreeid er ændret til cmstabid','Frontend - tuksi.lib\r\nBackend - elements.php\r\nBackend - elements_admin.php',0,1),(36,'Nyt element kommer til sidst og er Ã¥ben.','2004-12-08 00:00:00','HJO','Ved at bruge #SEQ# i sin insert sql, kan man få rækken oprettet med højste seq.\r\n\r\nDerudover er den nyoprettede række åben.','','modules/tables/fieldtypes/multiple_element.inc',0,1),(37,'Ny release script','2005-05-02 00:00:00','HJO','Der bruges nu rsync til at release med, hvilket gør at den kun kopiere det over som er nyt.\r\n\r\nDen kopiere kun de tabelmapper over som er klikket af som LIVE tabel.\r\n\r\nhttp://samba.anu.edu.au/rsync/','','/modules/release/release.php',0,1),(38,'Lista, nu med seq knapper','2005-07-15 00:00:00','HJO','Man kan nu have pil op og ned knapper til redigering af SEQ.\r\n\r\nSHOWSEQBTN: Enter field that contains seq number (seq). Makes sequence buttons in list. Need TABLENAME AND SQL1. SQL1 need to be ordered by seq to work!','','modules/tables/lista.php',0,1),(39,'Felttype Ã¦ndret: Selectboks - Egen liste','2005-08-22 00:00:00','HJO','\r\nBeskrivelse: Selectboks med værdier fra feltværdi 1\r\n\r\nBeskrivelse - Value 1: Værdier i selectboks splittet med \",\"\r\nBeskrivelse - Value 2: Start værdi\r\nBeskrivelse - Value 3:  1=Giver ID forløbende numre (default).\r\n                                     2=Splitter værdierne (value1=tekst1) med \"=\", og sætter ID = value1\r\n                                     3=Værdierne sættes som ID.','','modules/tables/fieldtypes/standard_types.inc',0,1);
