0></p>\r\n		\r\n<p><TR><br />\r\n			<TD vAlign=top>Mekanikudviklere til mekaniske løsninger </TD><br />\r\n			<TD align=right width=20></TD><br />\r\n			<TD width=10> </TD><br />\r\n			<TD style=\"POSITION: relative; TOP: -51px\" align=right width=20><A id=dnn_ctr20982_dnnPRINTBUTTON_ico7 href=\"javascript:__doPostBack(\'dnn$ctr20982$dnnPRINTBUTTON$ico7\',\'\')\"></A>  </TD><br />\r\n			<TD width=15> </TD></TR></TABLE></TD></TR><TR><TD width=\"100%\"><br />\r\n			<TABLE class=ContainerContent cellSpacing=0 cellPadding=0 width=\"100%\"></p>\r\n		\r\n<p><TR><br />\r\n			<TD id=dnn_ctr20982_ContentPane align=left></p>\r\n		\r\n<p><TABLE class=Normal style=\"WIDTH: 440px\" cellSpacing=0 cellPadding=2 align=center border=0></p>\r\n		\r\n<p><TR><br />\r\n			<TD><br />\r\n			Savner du forandring, afveksling og udfordringer i din hverdag? <BR>Tænder du på nye opgaver hvert ½ - 1 år inden for helt nye brancher og produktområder sammen med nye og spændende kollegaer? <BR>Så er en stilling hos Embedit måske netop lige noget for dig!<BR><BR><STRONG>Vi søger</STRONG><BR>Embedit søger erfarne mekanikudviklere til udvikling af apparatrelaterede mekaniske løsninger. Foruden selve apparaterne udvikler vi også tit apparattilbehør, emballering og testopstillinger.<br><br />\r\n			Vi forventer, at du på den ene side er bredt funderet, kender de forskellige mekaniske udviklingsdiscipliner, har stor forståelse for indkapsling og maskimekaniske detaljer og mestrer de gængse 3D CAD systemer.<br><br />\r\n			Herudover ser vi meget gerne, at du behersker et eller flere relevante fagområder særlig godt. Dette kan fx være:<br><br />\r\n			<UL><br />\r\n			<LI>Plastkonstruktion </LI><br />\r\n			<LI>Tyndpladekonstruktion </LI><br />\r\n			<LI>Finmekanik </LI><br />\r\n			<LI>Mekatronik </LI><br />\r\n			<LI>EMC kapsling samt IP klassernes krav og løsning heraf </LI><br />\r\n			<LI>Materialelære ( plast og/eller metaller) </LI><br />\r\n			<LI>Emballering </LI><br />\r\n			<LI>Komponentkendskab</LI></UL><br />\r\n			<STRONG>Vi forventer<BR></STRONG>Det er vigtigt, at du har en dokumenteret professionel erfaring fra udvikling inden for apparatverden (embeddede systemer). Vi forventer således, at du har min 5 års professionel erfaring indenfor området. En faglig uddannelse som ingeniør B.Sc/M.Sc eller tilsvarende vil være en væsentlig fordel.<br><br />\r\n			På det personlige plan forventer vi, at du er udadvendt, har let ved at kommunikere på alle niveauer i en udviklingsafdeling og har lyst til at udøve konsulentrollen. Du skal beherske både dansk og engelsk i skrift og tale.<BR><BR><STRONG>Vi tilbyder</STRONG><BR>Embedit tilbyder en arbejdsplads med meget varierende opgaver. Udover dine eventuelle specialer vil du derfor kunne udvikle dine faglige kompetencer på opgaver inden for helt nye områder. <br><br />\r\n			Embedit er qua virksomhedens særlige karakter som udviklings- og konsulenthus meget fokuseret på at have en aktiv og levende personalekultur med både sociale aktiviteter og en stærk faglig ånd. Netop for at binde vores ofte spredte medarbejdere sammen i et velfungerende Embedit netværk, hvor vi kan udnytte den fælles faglige parathed og viden, gennemfører vi mange fælles aktiviteter af både faglig og social karakter.<br><br />\r\n			<STRONG>Kontakt</STRONG><BR>Motiveret ansøgning samt CV bedes sendt til <A href=\"<a href=\"\'mailto:job@embedit.dk?subject=Mekanik%20udvikler\" ?>\'mailto:job@embedit.dk?subject=Mekanik%20udvikler</a>mailto:job@embedit.dk?subject=Mekanik%20udvikler\">job(@)embedit.dk</A> hurtigst muligt. <BR><BR>Eventuelle spørgsmål m.v. kan sendes til samme e-mail adresse eller ved henvendelse til <STRONG>Henrik R. Olesen</STRONG>, ressource- og projketchef, mobil: <STRONG>29 68 46 80</STRONG>.<BR><BR>Stillingerne behandles løbende og vil forblive opslået indtil alle er besat.<br></TD></TR></TABLE></TD></TR></TABLE></TD></TR>Et udviklings- og kompetencehus som Embedit A/S lever af deres medarbejderes teknologiske omskiftelighed. Derfor er det ikke bare ønskværdigt, men decideret nødvendigt for Embedits fortsatte succes, at deres konsulenter til stadighed holdes ajour med den seneste udvikling inden for embedded-området. <br><br />\r\n			<br><br />\r\n			<U>Virksomheden</U><br><br />\r\n			Vores kunde, Embedit A/S, blev grundlagt i år 2000 og er i dag et af Danmarks førende udviklings- og kompetencehuse inden for udviklingen af indlejret elektronik, software og mekanik. Firmaet har lige fra etableringen og frem til i dag været præget af stærk vækst og fremgang, og fremstår derfor som en succesfuld og finansielt meget sund virksomhed. Embedit råder over nogle af Danmarks bedste udviklere inden for embeddede systemer.<br><br />\r\n			<br><br />\r\n			Embedits ydelser inden for rådgivning og produktudvikling tilbydes i form af insourcing, hvor Embedits konsulenter eller tilknyttede specialister indgår i kundernes team. Og i form af outsourcing, hvor Embedits konsulenter udvikler hele eller dele af kundernes apparater i Embedits egen udviklingslokaler i Herlev. En kombination forekommer ofte.<br><br />\r\n			<br><br />\r\n			Det er Embedits vision at blive Danmarks mest leveringsparate udbyder af de bedste udviklere og løsninger inden for den embeddede verden. Embedits mission er at hjælpe innovative virksomheder med at udvikle avanceret elektronik og indlejret software af høj kvalitet og til rette tid. Kvalitet kommer ikke af sig selv. Derfor grundfæster Embedit deres arbejde i ansvar, engagement samt omstillingsparathed og imødekommenhed.<br><br />\r\n			<br><br />\r\n			<U>Stillingen</U> <br><br />\r\n			Embedit søger flere erfarne softwareudviklere til udvikling af embeddede systemer. Firmaet begrænser sig ikke til at beherske en række teknologier. Som kompetencehus skal Embedit være i stand til at håndtere stort set hvilken som helst udfordring inden for deres domæne og konsulenterne har derfor mulighed for at arbejde med vidt forskellige teknologier og opgavetyper. Her et par eksempler: embedded Linux/Windows systemer, hard real-time systemer, software til SoC systemer, objektorienteret implementering af embedded systemer, modellering af embedded systemer, projektledelse af embedded projekter, etc.<br><br />\r\n			<br><br />\r\n			En typisk konsulent hos Embedit tilbringer 2/3 af sin tid hos kunder og er ude hos 2 kunder i løbet af et år. Så selvom tilværelsen som konsulent er meget dynamisk, så har opgaverne traditionelt en vis tyngde og varighed. Du vil så vidt muligt få lejlighed til at arbejde med dine specialer, men også med områder, som er helt nye for dig.<br><br />\r\n			<br><br />\r\n			Embedit er, qua virksomhedens særlige karakter som udviklings- og konsulenthus, meget fokuseret på at have en aktiv og levende personalekultur med både sociale aktiviteter og en stærk faglig ånd. Der gennemføres mange fælles aktiviteter af både social og faglig karakter, netop for at binde de ofte spredte medarbejdere sammen i et velfungerende netværk hvor de kan udnytte den fælles faglige parathed og viden.<br><br />\r\n			<br><br />\r\n			<U>Personen</U> <br><br />\r\n			For at komme i betragtning til stillingen som konsulent hos Embedit A/S kræves det, at du:<br></p>\r\n		\r\n<p><UL><br />\r\n			<LI>Har min 3-5 års professionel softwareudviklingserfaring indenfor den embeddede verden. Det forventes, at du på den ene side er bredt funderet, kender de forskellige mikroelektroniske periferienheder nogenlunde, har forståelse for tidskritiske systemer, behersker C på højt niveau, har kørekort til debugger samt forståelse for modellering af embeddede systemer. <br />\r\n			<LI>Er uddannet elektroingeniør eller tilsvarende. <br />\r\n			<LI>Behersker dansk og engelsk i skrift og tale.</LI></UL><br />\r\n			Herudover ser vi meget gerne at du behersker et eller flere områder særlig godt, eksempelvis:<br></p>\r\n		\r\n<p><UL><br />\r\n			<LI>Udvikling af embedded Linux / uClinux systemer <br />\r\n			<LI>Udvikling af embedded Windows systemer (XP / CE) <br />\r\n			<LI>Udvikling af hard real-time systemer <br />\r\n			<LI>Udvikling af traditionel eller HDL software til SoC/SoPC/PSoC systemer <br />\r\n			<LI>Projektledelse af embeddede projekter (formel uddannelse er et plus) <br />\r\n			<LI>UML modellering af embeddede systemer (bl.a. klasse, sekvens og tilstandsdiagrammer) <br />\r\n			<LI>Objektorienteret implementation (C++) af embeddede systemer </LI></UL><br />\r\n			På det personlige plan forventer vi at du er udadvendt, har let ved at kommunikere på alle niveauer i en udviklingsafdeling og har lyst til konsulentrollen. <br><br />\r\n			<br><br />\r\n			<U>Kontakt</U> <br><br />\r\n			Fristen for ansøgning er den 26.06.2006. Ansøgninger behandles løbende og annoncen forlænges ugentligt indtil stillingen er besat. Stillingen håndteres af Christian Winberg, som kan kontaktes på 70 25 55 71 for yderligere oplysninger. Du søger stillingen via TechPeoples hjemmeside (<A href=\"<a href=\"http://www.techpeople.dk/stillinger/1/job/116/\">http://www.techpeople.dk/stillinger/1/job/116/</a>\" target=_blank target=\"_blank\">http://www.techpeople.dk/stillinger/1/job/116/</A>), hvor du klikker \"apply\" nederst til højre på siden. <br><br />\r\n			<br><br />\r\n			</p></span></div>',14,NULL,'','','','','',100,1,0,'','',0,1,NULL,NULL,NULL,0),(13683,'table','pg_module','moduletype',107,'Module type',NULL,38,NULL,'standard=Standard modul,nyhedsbrev=Nyhedsbrev modul,custom=Custom modul,backend=Backend','','2','','',300,1,0,'','',0,1,NULL,NULL,NULL,0),(13684,'table','pg_module','dummy_allowedarea',107,'Kan bruges i disse skabeloner/kolonner',NULL,72,NULL,'','','','','',1000,1,0,'','',0,1,NULL,NULL,NULL,0),(13687,'table','pg_allowedmodules','pg_moduleid',171,'VÃ¦lg element',NULL,4,NULL,'','','','','',200,1,0,'','',0,1,NULL,NULL,NULL,0),(13688,'table','seo_ranksetup','id',172,'',NULL,10,NULL,'','','','','',100,1,24,'','',0,1,NULL,NULL,NULL,0),(13689,'table','seo_ranksetup','name',172,'Navn',NULL,2,NULL,'','','','','',400,1,0,'','',0,1,NULL