INSERT INTO `cmstest` VALUES (185,'hej frans',100,NULL,NULL,NULL,NULL,NULL,0,0,NULL,'\r\n\r\n<p>\r\n	\r\n	\r\n	<br />\r\n	\r\n	\r\n	\r\n	\r\n\r\n	</p>\r\n<p> </p>\r\n		\r\n\r\n	\r\n<p>\r\n			\r\n</p><br />\r\n\r\n	\r\n						\r\n					\r\n<br />\r\n\r\n	\r\n						\r\n					\r\n<br />\r\n\r\n	\r\n						\r\n					\r\n<br />\r\n\r\n	\r\n						\r\n					\r\n<br />\r\n\r\n	\r\n						\r\n					\r\n\r\n	\r\n<table width=\"100%\" cellspacing=\"0\" cellpadding=\"0\" border=\"0\" class=\"ContainerTop\">\r\n		\r\n\r\n		\r\n	<tbody>\r\n				\r\n\r\n			\r\n		<tr>\r\n					\r\n				\r\n			<td valign=\"top\">Mekanikudviklere til mekaniske løsninger </td>\r\n					\r\n				\r\n			<td width=\"20\" align=\"right\"><br />\r\n				\r\n					</td>\r\n					\r\n				\r\n			<td width=\"10\"> <br />\r\n				\r\n					</td>\r\n					\r\n				\r\n			<td width=\"20\" align=\"right\" style=\"position: relative; top: -51px;\"><a id=\"dnn_ctr20982_dnnPRINTBUTTON_ico7\" href=\"javascript:__doPostBack(\'dnn$ctr20982$dnnPRINTBUTTON$ico7\',\'\')\"></a>  <br />\r\n				\r\n					</td>\r\n					\r\n				\r\n			<td width=\"15\"> <br />\r\n				\r\n					</td>\r\n				\r\n			\r\n		</tr>\r\n			\r\n		\r\n	</tbody>\r\n	\r\n	\r\n</table>\r\n	\r\n	\r\n	<br />\r\n\r\n	\r\n	\r\n	\r\n\r\n	\r\n<p> </p>\r\n		\r\n\r\n	\r\n<p>\r\n			\r\n</p><br />\r\n\r\n	\r\n						\r\n					\r\n\r\n	\r\n<table width=\"100%\" cellspacing=\"0\" cellpadding=\"0\" class=\"ContainerContent\">\r\n		\r\n\r\n		\r\n	<tbody>\r\n				\r\n\r\n			\r\n		<tr>\r\n					\r\n				\r\n			<td align=\"left\" id=\"dnn_ctr20982_ContentPane\">\r\n						\r\n\r\n					\r\n				<p> </p>\r\n						\r\n\r\n					\r\n				<p>\r\n							\r\n\r\n						</p>\r\n				<p> </p>\r\n								\r\n\r\n						\r\n				<p>\r\n									\r\n</p><br />\r\n				\r\n						\r\n												\r\n											\r\n\r\n						\r\n				<table cellspacing=\"0\" cellpadding=\"2\" border=\"0\" align=\"center\" class=\"Normal\" style=\"width: 440px;\">\r\n								\r\n\r\n							\r\n					<tbody>\r\n										\r\n\r\n								\r\n						<tr>\r\n											\r\n									\r\n							<td><br />\r\n								\r\n										\r\n												Savner du forandring, afveksling og udfordringer i din hverdag? <br />\r\n								\r\n										\r\n												Tænder du på nye opgaver hvert ½ - 1 år inden for helt nye brancher og produktområder sammen med nye og spændende kollegaer? <br />\r\n								\r\n										\r\n												Så er en stilling hos Embedit måske netop lige noget for dig!<br />\r\n								\r\n										\r\n												<br />\r\n								\r\n										\r\n												\r\n										\r\n								<span style=\"font-weight: bold;\">Vi søger</span><br />\r\n								\r\n										\r\n												Embedit søger erfarne mekanikudviklere til udvikling af apparatrelaterede mekaniske løsninger. Foruden selve apparaterne udvikler vi også tit apparattilbehør, emballering og testopstillinger.<br />\r\n								\r\n										\r\n												<br />\r\n								\r\n										\r\n												Vi forventer, at du på den ene side er bredt funderet, kender de forskellige mekaniske udviklingsdiscipliner, har stor forståelse for indkapsling og maskimekaniske detaljer og mestrer de gængse 3D CAD systemer.<br />\r\n								\r\n										\r\n												<br />\r\n								\r\n										\r\n												Herudover ser vi meget gerne, at du behersker et eller flere relevante fagområder særlig godt. Dette kan fx være:<br />\r\n								\r\n										\r\n												<br />\r\n								\r\n										\r\n												\r\n												\r\n\r\n										\r\n								<ul><br />\r\n									\r\n											\r\n													\r\n													\r\n\r\n											\r\n									<li>Plastkonstruktion <br />\r\n										\r\n												\r\n														</li>\r\n													\r\n\r\n											\r\n									<li>Tyndpladekonstruktion <br />\r\n										\r\n												\r\n														</li>\r\n													\r\n\r\n											\r\n									<li>Finmekanik <br />\r\n										\r\n												\r\n														</li>\r\n													\r\n\r\n											\r\n									<li>Mekatronik <br />\r\n										\r\n												\r\n														</li>\r\n													\r\n\r\n											\r\n									<li>EMC kapsling samt IP klassernes krav og løsning heraf <br />\r\n										\r\n												\r\n														</li>\r\n													\r\n\r\n											\r\n									<li>Materialelære ( plast og/eller metaller) <br />\r\n										\r\n												\r\n														</li>\r\n													\r\n\r\n											\r\n									<li>Emballering <br />\r\n										\r\n												\r\n														</li>\r\n													\r\n\r\n											\r\n									<li>Komponentkendskab</li>\r\n												\r\n										\r\n								</ul><br />\r\n								\r\n										\r\n												\r\n										\r\n								<span style=\"font-weight: bold;\">Vi forventer<br />\r\n									\r\n											\r\n													</span>Det er vigtigt, at du har en dokumenteret professionel erfaring fra udvikling inden for apparatverden (embeddede systemer). Vi forventer således, at du har min 5 års professionel erfaring indenfor området. En faglig uddannelse som ingeniør B.Sc/M.Sc eller tilsvarende vil være en væsentlig fordel.<br />\r\n								\r\n										\r\n												<br />\r\n								\r\n										\r\n												På det personlige plan forventer vi, at du er udadvendt, har let ved at kommunikere på alle niveauer i en udviklingsafdeling og har lyst til at udøve konsulentrollen. Du skal beherske både dansk og engelsk i skrift og tale.<br />\r\n								\r\n										\r\n												<br />\r\n								\r\n										\r\n												\r\n										\r\n								<span style=\"font-weight: bold;\">Vi tilbyder</span><br />\r\n								\r\n										\r\n												Embedit tilbyder en arbejdsplads med meget varierende opgaver. Udover dine eventuelle specialer vil du derfor kunne udvikle dine faglige kompetencer på opgaver inden for helt nye områder. <br />\r\n								\r\n										\r\n												<br />\r\n								\r\n										\r\n												Embedit er qua virksomhedens særlige karakter som udviklings- og konsulenthus meget fokuseret på at have en aktiv og levende personalekultur med både sociale aktiviteter og en stærk faglig ånd. Netop for at binde vores ofte spredte medarbejdere sammen i et velfungerende Embedit netværk, hvor vi kan udnytte den fælles faglige parathed og viden, gennemfører vi mange fælles aktiviteter af både faglig og social karakter.<br />\r\n								\r\n										\r\n												<br />\r\n								\r\n										\r\n												\r\n										\r\n								<span style=\"font-weight: bold;\">Kontakt</span><br />\r\n								\r\n										\r\n												Motiveret ansøgning samt CV bedes sendt til <a href=\"&lt;a href=\" ?mailto:job@embedit.dk?subject=\"\'Mekanik%20udvikler\">job(@)embedit.dk</a>mailto:job@embedit.dk?subject=Mekanik%20udvikler\">job(@)embedit.dk> hurtigst muligt. <br />\r\n								\r\n										\r\n												<br />\r\n								\r\n										\r\n												Eventuelle spørgsmål m.v. kan sendes til samme e-mail adresse eller ved henvendelse til \r\n										\r\n								<span style=\"font-weight: bold;\">Henrik R. Olesen</span>, ressource- og projketchef, mobil: \r\n										\r\n								<span style=\"font-weight: bold;\">29 68 46 80</span>.<br />\r\n								\r\n										\r\n												<br />\r\n								\r\n										\r\n												Stillingerne behandles løbende og vil forblive opslået indtil alle er besat.<br />\r\n								\r\n										\r\n												</td>\r\n										\r\n								\r\n						</tr>\r\n									\r\n							\r\n					</tbody>\r\n							\r\n						\r\n				</table>\r\n				<p>&nbsp;</p></td>\r\n				\r\n			\r\n		</tr>\r\n			\r\n		\r\n	</tbody>\r\n	\r\n	\r\n</table>Et udviklings- og kompetencehus som Embedit A/S lever af deres medarbejderes teknologiske omskiftelighed. Derfor er det ikke bare ønskværdigt, men decideret nødvendigt for Embedits fortsatte succes, at deres konsulenter til stadighed holdes ajour med den seneste udvikling inden for embedded-området. <br />\r\n\r\n	\r\n	<br />\r\n\r\n	\r\n	<br />\r\n\r\n	\r\n	<br />\r\n\r\n	\r\n	\r\n	\r\n	\r\n<span style=\"text-decoration: underline;\">Virksomheden</span><br />\r\n\r\n	\r\n	<br />\r\n\r\n	\r\n	Vores kunde, Embedit A/S, blev grundlagt i år 2000 og er i dag et af Danmarks førende udviklings- og kompetencehuse inden for udviklingen af indlejret elektronik, software og mekanik. Firmaet har lige fra etableringen og frem til i dag været præget af stærk vækst og fremgang, og fremstår derfor som en succesfuld og finansielt meget sund virksomhed. Embedit råder over nogle af Danmarks bedste udviklere inden for embeddede systemer.<br />\r\n\r\n	\r\n	<br />\r\n\r\n	\r\n	<br />\r\n\r\n	\r\n	<br />\r\n\r\n	\r\n	Embedits ydelser inden for rådgivning og produktudvikling tilbydes i form af insourcing, hvor Embedits konsulenter eller tilknyttede specialister indgår i kundernes team. Og i form af outsourcing, hvor Embedits konsulenter udvikler hele eller dele af kundernes apparater i Embedits egen udviklingslokaler i Herlev. En kombination forekommer ofte.<br />\r\n\r\n	\r\n	<br />\r\n\r\n	\r\n	<br />\r\n\r\n	\r\n	<br />\r\n\r\n	\r\n	Det er Embedits vision at blive Danmarks mest leveringsparate udbyder af de bedste udviklere og løsninger inden for den embeddede verden. Embedits mission er at hjælpe innovative virksomheder med at udvikle avanceret elektronik og indlejret software af høj kvalitet og til rette tid. Kvalitet kommer ikke af sig selv. Derfor grundfæster Embedit deres arbejde i ansvar, engagement samt omstillingsparathed og imødekommenhed.<br />\r\n\r\n	\r\n	<br />\r\n\r\n	\r\n	<br />\r\n\r\n	\r\n	<br />\r\n\r\n	\r\n	\r\n	\r\n	\r\n<span style=\"text-decoration: underline;\">Stillingen</span> <br />\r\n\r\n	\r\n	<br />\r\n\r\n	\r\n	Embedit søger flere erfarne softwareudviklere til udvikling af embeddede systemer. Firmaet begrænser sig ikke til at beherske en række teknologier. Som kompetencehus skal Embedit være i stand til at håndtere stort set hvilken som helst udfordring inden for deres domæne og konsulenterne har derfor mulighed for at arbejde med vidt forskellige teknologier og opgavetyper. Her et par eksempler: embedded Linux/Windows systemer, hard real-time systemer, software til SoC systemer, objektorienteret implementering af embedded systemer, modellering af embedded systemer, projektledelse af embedded projekter, etc.<br />\r\n\r\n	\r\n	<br />\r\n\r\n	\r\n	<br />\r\n\r\n	\r\n	<br />\r\n\r\n	\r\n	En typisk konsulent hos Embedit tilbringer 2/3 af sin tid hos kunder og er ude hos 2 kunder i løbet af et år. Så selvom tilværelsen som konsulent er meget dynamisk, så har opgaverne traditionelt en vis tyngde og varighed. Du vil så vidt muligt få lejlighed til at arbejde med dine specialer, men også med områder, som er helt nye for dig.<br />\r\n\r\n	\r\n	<br />\r\n\r\n	\r\n	<br />\r\n\r\n	\r\n	<br />\r\n\r\n	\r\n	Embedit er, qua virksomhedens særlige karakter som udviklings- og konsulenthus, meget fokuseret på at have en aktiv og levende personalekultur med både sociale aktiviteter og en stærk faglig ånd. Der gennemføres mange fælles aktiviteter af både social og faglig karakter, netop for at binde de ofte spredte medarbejdere sammen i et velfungerende netværk hvor de kan udnytte den fælles faglige parathed og viden.<br />\r\n\r\n	\r\n	<br />\r\n\r\n	\r\n	<br />\r\n\r\n	\r\n	<br />\r\n\r\n	\r\n	\r\n	\r\n	\r\n<span style=\"text-decoration: underline;\">Personen</span> <br />\r\n\r\n	\r\n	<br />\r\n\r\n	\r\n	For at komme i betragtning til stillingen som konsulent hos Embedit A/S kræves det, at du:<br />\r\n\r\n	\r\n	\r\n<p>&nbsp;</p>\r\n\r\n\r\n\r\n<p> </p>\r\n\r\n\r\n\r\n<ul><br />\r\n	\r\n	\r\n	\r\n	\r\n\r\n	\r\n	<li>Har min 3-5 års professionel softwareudviklingserfaring indenfor den embeddede verden. Det forventes, at du på den ene side er bredt funderet, kender de forskellige mikroelektroniske periferienheder nogenlunde, har forståelse for tidskritiske systemer, behersker C på højt niveau, har kørekort til debugger samt forståelse for modellering af embeddede systemer. <br />\r\n		\r\n		\r\n		</li>\r\n	\r\n\r\n	\r\n	<li>Er uddannet elektroingeniør eller tilsvarende. <br />\r\n		\r\n		\r\n		</li>\r\n	\r\n\r\n	\r\n	<li>Behersker dansk og engelsk i skrift og tale.</li>\r\n\r\n\r\n</ul><br />\r\n\r\n\r\nHerudover ser vi meget gerne at du behersker et eller flere områder særlig godt, eksempelvis:<br />\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p> </p>\r\n\r\n\r\n\r\n<p> </p>\r\n\r\n\r\n\r\n<ul><br />\r\n	\r\n	\r\n	\r\n	\r\n\r\n	\r\n	<li>Udvikling af embedded Linux / uClinux systemer <br />\r\n		\r\n		\r\n		</li>\r\n	\r\n\r\n	\r\n	<li>Udvikling af embedded Windows systemer (XP / CE) <br />\r\n		\r\n		\r\n		</li>\r\n	\r\n\r\n	\r\n	<li>Udvikling af hard real-time systemer <br />\r\n		\r\n		\r\n		</li>\r\n	\r\n\r\n	\r\n	<li>Udvikling af traditionel eller HDL software til SoC/SoPC/PSoC systemer <br />\r\n		\r\n		\r\n		</li>\r\n	\r\n\r\n	\r\n	<li>Projektledelse af embeddede projekter (formel uddannelse er et plus) <br />\r\n		\r\n		\r\n		</li>\r\n	\r\n\r\n	\r\n	<li>UML modellering af embeddede systemer (bl.a. klasse, sekvens og tilstandsdiagrammer) <br />\r\n		\r\n		\r\n		</li>\r\n	\r\n\r\n	\r\n	<li>Objektorienteret implementation (C++) af embeddede systemer </li>\r\n\r\n\r\n</ul><br />\r\n\r\n\r\nPå det personlige plan forventer vi at du er udadvendt, har let ved at kommunikere på alle niveauer i en udviklingsafdeling og har lyst til konsulentrollen. <br />\r\n\r\n\r\n<br />\r\n\r\n\r\n<br />\r\n\r\n\r\n<br />\r\n\r\n\r\n\r\n\r\n\r\n<span style=\"text-decoration: underline;\">Kontakt</span> <br />\r\n\r\n\r\n<br />\r\n\r\n\r\nFristen for ansøgning er den 26.06.2006. Ansøgninger behandles løbende og annoncen forlænges ugentligt indtil stillingen er besat. Stillingen håndteres af Christian Winberg, som kan kontaktes på 70 25 55 71 for yderligere oplysninger. Du søger stillingen via TechPeoples hjemmeside (<a href=\"&lt;a href=\" ?=\"\" 116=\"\" job=\"\" 1=\"\" stillinger=\"\" www.techpeople.dk=\"\" http=\"\">http://www.techpeople.dk/stillinger/1/job/116/</a>\" target=_blank target=\"_blank\">http://www.techpeople.dk/stillinger/1/job/116/), hvor du klikker \"apply\" nederst til højre på siden. <br />\r\n\r\n\r\n<br />\r\n\r\n\r\n<br />\r\n\r\n\r\n<br />\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p> </p>',NULL,0,'VÃ¦rdi 1');
