gen fÃ¥r ubehagelige overraskelser senere','','2007-03-27 15:46:28','2007-06-01 10:33:26','2007-07-05 16:15:19','','',2,7,0,NULL),(9692,238,300,1,'','','',32,NULL,'Teknik',73,0,'Teknik',1,1,'Teknik',NULL,1,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'teknik',NULL,'/root/indhold/forside/teknik.html',NULL,NULL,' To versioner af TUKSI\r\n	Tuksi findes i to versioner: en til Windows NT og en til Linux. Windows NT-udgaven er udviklet til kunder, der har en politik om kun at anvende Microsoft-produkter. Linux-versionen bygger pÃ¥ open source, sÃ¥ andre programmÃ¸rer kan arbejde videre med systemet.\r\n&nbsp;\r\nProgrammeringssprog og databaser\r\nI Linux versionen er programmeringssproget PHP. Hjemmesidens indhold ligger i databasen MySQL. I Windows NT-udgaven er programmeringssproget ASP. Her ligger indholdet i databasen MSSQL. \r\n&nbsp;\r\nPlacering af server\r\nTuksi-lÃ¸sningen kan enten placeres pÃ¥ kundens egen server eller pÃ¥ en af Dwarfs fÃ¦lles servere hos den professionelle udbyder UNI2. UNI2 vedligeholder serveren og sikrer, at ingen data gÃ¥r tabt, ogsÃ¥ selvom hele landet skulle blive ramt af strÃ¸msvigt.\r\n&nbsp;\r\nAnbefaling af serverlÃ¸sning\r\nVed smÃ¥ og mellemstore lÃ¸sninger anbefaler vi Dwarfs fÃ¦lles servere hos UNI2. Ved store lÃ¸sninger som f.eks. ILVA eller Rockfon sÃ¸rger Dwarf typisk for opstilling af en eller flere servere, som kun betjener den kunde. OgsÃ¥ ved de store lÃ¸sninger anbefaler vi, at UNI2 stÃ¥r for drift- og vedligeholdelse.','teknik to versioner af tuksi	tuksi findes versioner: en til windows nt og linux nt-udgaven er udviklet kunder der har politik om kun at anvende microsoft-produkter linux-versionen bygger pÃ¥ open source sÃ¥ andre programmÃ¸rer kan arbejde videre med systemet;programmeringssprog databaseri versionen programmeringssproget php hjemmesidens indhold ligger databasen mysql asp her indholdet mssql ;placering servertuksi-lÃ¸sningen enten placeres kundens egen server eller dwarfs fÃ¦lles servere hos den professionelle udbyder uni2 vedligeholder serveren sikrer ingen data gÃ¥r tabt ogsÃ¥ selvom hele landet skulle blive ramt strÃ¸msvigt;anbefaling serverlÃ¸sningved smÃ¥ mellemstore lÃ¸sninger anbefaler vi ved store som feks ilva rockfon sÃ¸rger dwarf typisk for opstilling flere betjener kunde de stÃ¥r drift- vedligeholdelse','','2007-03-28 14:45:15','2007-04-25 15:35:39','2007-07-05 16:15:20',NULL,NULL,2,NULL,0,NULL),(9693,238,650,20,'','','',32,NULL,'Om Tuksi \'\' Ã¥Ã¸Ã¦Ã¥',73,1,'Om Tuksisadsad',1,1,'Om Tuksiasdsad','cmstree/9693_pg_comment_4301.ppt',1,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'om_tuksi',NULL,'/root/indhold/forside/om_tuksi.html',NULL,0,' \r\nIndhold kan redigeres overalt\r\nTuksi er et 100% browserbaseret Content Management System. Det betyder, at du kan vedligeholde din virksomheds hjemmeside og intranet fra en hvilken som helst computer med en internettetopkobling. Du behÃ¸ver ikke at kende noget til programmering, og du har heller ikke brug for at installere ekstra programmer.\r\n\r\n\r\nAnsvar for indhold fordeles\r\nTuksi gÃ¸r det let at sprede ansvaret for indholdet ud til flere i virksomheden. Hver bruger kan tildeles rettigheder, sÃ¥ det f.eks. kun er webredaktÃ¸ren, der kan tilfÃ¸je menuer pÃ¥ hjemmesiden.\r\n\r\n\r\nTuksi gÃ¸r det grove â du gÃ¸r det sjove\r\nTuksi giver designere og udviklere frie hÃ¦nder til at skabe nÃ¸jagtigt det udtryk og de funktioner, din virksomhed Ã¸nsker. Tuksi bestÃ¥r i dag af en grundpakke og en rÃ¦kke moduler, som giver ekstra funktionalitet.\r\n\r\n\r\nIngen stavnsbinding\r\nTuksi bygger pÃ¥ open source. Det garanterer, at din virksomhed altid vil kunne arbejde videre med webplatformen eller intranettet, ogsÃ¥ selvom I senere mÃ¥tte vÃ¦lge en anden samarbejdspartner end Dwarf.','om tuksi indhold kan redigeres overalttuksi er et 100% browserbaseret content management system det betyder at du vedligeholde din virksomheds hjemmeside og intranet fra en hvilken som helst computer med internettetopkobling behÃ¸ver ikke kende noget til programmering har heller brug for installere ekstra programmeransvar fordelestuksi gÃ¸r let sprede ansvaret indholdet ud flere virksomheden hver bruger tildeles rettigheder sÃ¥ feks kun webredaktÃ¸ren der tilfÃ¸je menuer pÃ¥ hjemmesidentuksi grove sjovetuksi giver designere udviklere frie hÃ¦nder skabe nÃ¸jagtigt udtryk de funktioner virksomhed Ã¸nsker bestÃ¥r dag af grundpakke rÃ¦kke moduler funktionalitetingen stavnsbindingtuksi bygger open source garanterer altid vil kunne arbejde videre webplatformen eller intranettet ogsÃ¥ selvom senere mÃ¥tte vÃ¦lge anden samarbejdspartner end dwarf','','2007-03-29 10:53:38','2008-04-17 14:34:37','2007-07-05 16:15:19',NULL,NULL,2,7,0,NULL),(9695,9693,100,1,'','','',32,NULL,' Internet adgang',73,1,' Internet adgang',1,1,' Internet adgang',NULL,1,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'_internet_adgang',NULL,'/root/indhold/forside/om_tuksi/_internet_adgang.html',NULL,NULL,' Du kan redigere hjemmesider med Tuksi, uanset hvor i verden du befinder dig. Blot du har adgang til en computer med internetadgang. \r\n&nbsp;\r\nTuksi giver mulighed for, at hver bruger kan tildeles forskellige rettigheder. AfhÃ¦ngigt af, hvordan dine rettigheder er sat op, vil du fÃ¥ forskellige menupunkter at se, nÃ¥r du logger ind.','internet adgang du kan redigere hjemmesider med tuksi uanset hvor verden befinder dig blot har til en computer internetadgang ;tuksi giver mulighed for at hver bruger tildeles forskellige rettigheder afhÃ¦ngigt af hvordan dine er sat op vil fÃ¥ menupunkter se nÃ¥r logger ind','pg_content/12225_image_3544_1.jpg','2007-04-04 14:59:40','2007-07-03 16:03:07','2007-07-05 16:15:19',NULL,NULL,2,NULL,0,NULL),(9697,4,200,20,'','','',32,NULL,'Forside EN',73,1,'Forside EN',1,1,NULL,NULL,1,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,0,'','forside en','',NULL,'2007-04-13 11:26:15','2007-07-05 16:06:44','','',2,NULL,0,NULL),(9700,9697,100,1,'','','',32,NULL,'Topmenu 1',73,1,'Topmenu 1',1,1,'Topmenu 1',NULL,1,NULL,NULL,NULL,NULL,NULL,NULL