ef=\"http://test.t4.hjo.meer2-udv.dwarf.dk/newsletter/?treeid=&t=[TRACKINGID]\">her</a>\r\n<body bgcolor=\"#a2adb4\" link=\"#2f556a\">\r\n	<table width=\"100%\" bgcolor=\"#a2adb4\" cellpadding=\"0\" cellspacing=\"0\">\r\n		<tr>\r\n			<td>\r\n				<center>\r\n					<table width=\"588\" cellspacing=\"0\" cellpadding=\"0\">\r\n							<tr>\r\n								<td width=\"88\" align=\"left\" style=\"text-align: left;\"><a href=\"http://test.t4.hjo.meer2-udv.dwarf.dk/mail_redirect_link/1.[TRACKINGID]/\"><img border=\"0\" src=\"http://test.t4.hjo.meer2-udv.dwarf.dk/images/graphics/logo.gif\"></a></td>\r\n							</tr>\r\n							<tr>\r\n								<td width=\"500\" height=\"71\" bgcolor=\"#ffffff\" align=\"left\" style=\"font-family: arial; font-size: 18px; font-weight: bold; color: rgb(34, 50, 65);\"><img width=\"10\" height=\"1\" src=\"http://test.t4.hjo.meer2-udv.dwarf.dk/t.gif\"> : Default</td>\r\n							</tr>\r\n					</table>\r\n					<table width=\"588\" cellspacing=\"0\" cellpadding=\"0\" border=\"0\" bgcolor=\"#ffffff\">\r\n						<tr>\r\n							<td  width=\"542\" align=\"left\" style=\"text-align: left;\">\r\n									<!-- start: headline -->\n<tr>\n	<td width=\"535\">\n		<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"535\">\n		<tr>\n		</tr>\n		<tr>\n			<td><h1>Gravgaard spiller i aften</h1></td>\n		</tr>\n		<tr>\n		</tr>\n		</table>\n	</td>\n</tr>\n<!-- end: headline -->\n<!-- start: textonly  -->\n<tr>\n	<td width=\"535\">\n		<p>\r\n\r\n<p>Tyskland har en meget høj koncentration af tyrkiske indvandrere, og blandt dem en stor mængde fans af netop Galatasaray, og i den tyske avis Bild anslås det, at tusinder af dem har købt billet til kampen, hvor Michael Gravgaard i øvrigt gør comeback efter han brækkede fingeren i en Bundesligakamp mod Leverkusen. </p>\n				<br><br>\n			<a href=\"http://test.t4.hjo.meer2-udv.dwarf.dk/mail_redirect/546.[TRACKINGID]/\">Læs mere</a>\n				</p>\n	</td>\n</tr>\n<tr><td height=\"15\"></td></tr>\n<!-- end: textonly  --><!-- start: text/image -->\n<tr>\n	<td width=\"535\">\n		<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"535\">\n		<tr>\n			<td valign=\"top\">\n				<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\">\n				<tr>\n					<td>\n						<!-- start: text/image Headline -->\n						<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\">\n						<tr>\n						</tr>\n						<tr>\n							<td><h1>Test af nyhedsbrev</h1></td>\n						</tr>\n						<tr>\n						</tr>\n						</table>\n						<!-- end: text/image Headline -->\n					</td>\n				</tr>\n				<tr>\n					<td><p>\r\n\r\n<div>Danskeren, der er nummer 12 på verdensranglisten, lagde blødt ud mod sin et år ældre modstander, der er nummer 62 i verden. En enkelt gang blev danskeren brudt, og bagud med 2-3 i første sæt havde danskeren et break point mod sig. </div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>Se mere under Presse.</div>			<br><br>\n			<a href=\"http://test.t4.hjo.meer2-udv.dwarf.dk/mail_redirect/374.[TRACKINGID]/\">Læs mere</a>\n		</p></td>\n				</tr>\n				</table>\n			</td>\n			<td width=\"34\"></td>\n			<td valign=\"top\">\n				<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"242\">\n				<tr>\n				</tr>\n				<tr>\n					<td><img src=\"http://test.t4.hjo.meer2-udv.dwarf.dk/uploads/pg_content/374_image_3626.jpg\" height=\"182\" width=\"242\" alt=\"\"></td>\n				</tr>\n				<tr>\n				</tr>\n				</table>\n			</td>\n		</tr>\n		</table>\n	</td>\n</tr>\n<tr><td height=\"15\"></td></tr>\n<!-- end: text/image --><!-- start: image/text -->\n<tr>\n	<td width=\"535\">\n		<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"535\">\n		<tr>\n			<td valign=\"top\">\n				<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"248\">\n				<tr>\n				</tr>\n				<tr>\n					<td><img src=\"http://test.t4.hjo.meer2-udv.dwarf.dk/uploads/pg_content/544_image_7516.jpg\" height=\"182\" width=\"242\" alt=\"\"></td>\n				</tr>\n				<tr>\n				</tr>\n				</table>\n			</td>\n			<td width=\"34\"></td>\n			<td valign=\"top\">\n				<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\">\n				<tr>\n					<td>\n						<!-- start: text/image headline -->\n						<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\">\n						<tr>\n						</tr>\n						<tr>\n							<td><h1>Billede til højre</h1></td>\n						</tr>\n						<tr>\n						</tr>\n						</table>\n						<!-- end: text/image headline -->\n					</td>\n				</tr>\n				<tr>\n					<td><p>Siden har af flere spillere været kritiseret for ikke at have helt præcise tal, men der kan næppe herske tvivl om, at Gus Hansen gerne ville have været den nat foruden. 			<br><br>\n			<a href=\"http://test.t4.hjo.meer2-udv.dwarf.dk/mail_redirect/544.[TRACKINGID]/\">Læs mere</a>\n		</p></td>\n				</tr>\n				</table>\n			</td>\n		</tr>\n		</table>\n	</td>\n</tr>\n<tr><td height=\"15\"></td></tr>\n<!-- end: image/text --><!-- start: imageonly  -->\n<tr>\n	<td width=\"535\">\n		<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"535\">\n			<tr>\n				<td height=\"5\"></td>\n			</tr>\n			<tr>\n				<td width=\"529\"><img src=\"http://test.t4.hjo.meer2-udv.dwarf.dk/uploads/pg_content/545_image_821.jpg\" width=\"529\" height=\"182\" alt=\"\" style=\"display: block;\"></td>\n			</tr>\n			<tr>\n				<td height=\"5\"></td>\n			</tr>\n		</table>\n	</td>\n</tr>\n<tr><td height=\"15\"></td></tr>\n<!-- end: imageonly  -->\r\n							</td>\r\n						</tr>\r\n					</table>\r\n				</center>	\r\n			</td>\r\n		</tr>\r\n	</table>\r\n	<a href=\"http://test.t4.hjo.meer2-udv.dwarf.dk/mail_redirect_link/9.[TRACKINGID]/\">Frameld dig nyhedsbrevet her</a>\r\n\r\n<img SRC=\"http://test.t4.hjo.meer2-udv.dwarf.dk/email.[TRACKINGID]/email.gif\" ALT=\"\" WIDTH=\"11\" HEIGHT=\"11\" BORDER=\"0\">\r\n</body>\r\n</html>\r\n--000_alter_SO_PHP49cb9b99060da--\n--000_mixed_SO_PHP49cb9b99050dc--\n','2009-03-26 16:13:29',NULL,NULL,0,0,'',NULL),(292,'test',244,3,0,NULL,NULL,'2009-03-26 16:35:04',NULL,NULL,0,0,'hjo@dwarf.dk',NULL),(293,'test',244,3,0,NULL,NULL,'2009-03-26 16:35:34',NULL,NULL,0,0,'h