,16,56,163,1,NULL,NULL,NULL,100,NULL,NULL,NULL,'2008-06-17 16:17:56',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,178,'backend'),(180,23,9,163,1,'Beslutning',NULL,'\r\n\r\n<div class=\"text editorArea\">\r\n	\r\n<div>Den grundlæggende beslutning, når man vælger CMS, er om man skal have en standardiseret, modulbaseret platform eller en udviklingsplatform. </div>\r\n	\r\n<div><br />\r\n		Tuksi er en udviklingsplatform og kan derfor blive til præcis den løsning, du har brug for. Det er dog vores erfaring, at der er elementer i et website, de fleste kunder har brug for, og derfor har Tuksi da også en række standardmoduler og -funktioner. Dem kan man komme rigtig langt med.</div></div>',100,NULL,NULL,'','2008-07-25 08:12:39','','1','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,178,'frontend'),(268,17,100,142,1,NULL,NULL,NULL,100,NULL,NULL,'cmstree:189','2008-08-14 15:45:43',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,155,'frontend'),(269,17,9,83,1,'Frihed',NULL,'<p>1</p>',400,'',NULL,'','2008-08-15 09:19:48','','2','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,90,'frontend'),(587,16,56,291,1,NULL,NULL,NULL,100,NULL,NULL,NULL,'2008-06-17 16:17:56',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,314,'backend'),(588,17,4,291,0,'Billede',NULL,NULL,100,NULL,NULL,'cmstree:82','0000-00-00 00:00:00',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,1,1,0,'frontend'),(589,16,56,292,1,NULL,NULL,NULL,100,NULL,NULL,NULL,'2008-06-17 16:17:56',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,315,'backend'),(266,16,56,189,1,NULL,NULL,NULL,100,NULL,NULL,NULL,'2008-06-17 16:17:56',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NU