i kender, kan man i Tuksi sk&aelig;re sin billeder til inde i CMS&rsquo;et &ndash; s&aring; man springer langsommelige man&oslash;vrer i billedbehandlingsprogrammer over. Og slipper for at k&oslash;be dyre licenser, til programmer man ellers ikke har brug for.</div>\r\n<div>&nbsp;</div>\r\n<p>Vi har ogs&aring; optimeret vores nyhedsbrevsmodul, s&aring; vi er stensikre p&aring;, at det ser ordentligt og rigtigt ud uanset hvilket e-mail program, det vises i. Og s&aring; har det en drabeligt god statistikfunktion som kan fort&aelig;lle, hvor mange af modtagerne der faktisk l&aelig;ser nyhedsbrevet, og tracke hvor mange faktisk klikker p&aring; de links, der er lagt i nyhedsbrevet.</p>\r\n</div>\r\n</div>',300,NULL,NULL,'','2009-02-18 13:55:04','','1','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,88,'frontend'),(189,23,9,162,1,'Ny tuksi 4.0 med nyhedslister.',NULL,'\r\n\r\n<p>Tuksis udvikling er baseret på at lytte til kunderne, og det bør dit valg af CMS også være. Tuksibrugeres vurdering af produktet, kan hjælpe dig med at beslutte, om Tuksi er en mulighed for din organisation. Det er tit en bedre idé at lytte til sælgerens kunder end til sælgeren selv<br />\r\n	</p>',100,'pg_content/189_image_6053.jpg',NULL,'cmstree:82','2008-07-25 10:18:41','Tekst til billede vises ikke ...','2','Dette er nyt link',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,177,'frontend'),(192,23,9,154,1,'Nyhed',NULL,'Nyhed 1',100,NULL,NULL,NULL,'2008-07-25 10:41:41','','1','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,168,'frontend'),(193,23,9,156,1,'News',NULL,NULL,100,NULL,NULL,NULL,'2008-07-25 10:55:53',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,171,'frontend'),(194,16,56,167,1,NULL,NULL,NULL,100,NULL,NULL,NULL,'2008-07-24 15:51:09',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL