,NULL,NULL,NULL,0,NULL,NULL,90,'frontend'),(514,18,9,13,1,'',NULL,'<div><strong><span style=\"color: white;\"><sup>11.07.2008</sup></span></strong> <span style=\"color: black;\">\r\n<div><u><strong>Tuksi 4 release - Danmarks hurtigste og mest fleksible php udviklingsplatform</strong></u><strong> </strong></div>\r\n<div>&nbsp;</div>\r\n<div>Hurtigere, endnu mere skalerbar og nemmere at customize. Det er hvad den seneste udgave af content management systemet Tuksi er. Opgraderingen af Tuksi 3 til Tuksi 4 har betydet en komplet omskrivning af kernen i Tuksi.<br />\r\n<br />\r\nOpdateret og med en optimeret teknisk opbygning giver Tuksi 4 reduceret udviklingstid for kunderne, som g&oslash;r udvikling af tilpasning af avancerede online l&oslash;sninger b&aring;de billigere at bygge - og vedligeholde. Brugerfladen er ogs&aring; blevet re-designet, s&aring; det - om muligt - er blevet endnu lettere at v&aelig;re bruger af Tuksi.<br />\r\n<br />\r\n<em><strong>Med Tuksi 4 f&aring;r man nu et 100% stringent system - og det er stadig den eneste komplette, open-source, kommercielle udviklingsplatform p&aring; markedet.</strong></em></div>\r\n</span></div>',100,NULL,NULL,'','2009-02-18 13:26:42','','1','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,16,'frontend'),(334,17,4,229,0,NULL,NULL,NULL,50,NULL,NULL,NULL,'0000-00-00 00:00:00',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,1,1,NULL,'frontend'),(342,17,4,231,0,'sadasdasd',NULL,NULL,100,NULL,NULL,NULL,'0000-00-00 00:00:00',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,1,1,0,'frontend'),(348,16,102,7,1,NULL,NULL,NULL,100,NULL,NULL,NULL,'2008-09-05 15:49:39',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,252,'backend'),(352,17,9,189,1,'',NULL,'<p>Tabelbyggermodulet kan man bruge hvis man fx &oslash;nsker at lave en prisoversigt. Det er nemt