erand&oslash;r.</div>\r\n<div class=\"text editorArea\">&nbsp;</div>\r\n<div class=\"text editorArea\">Tuksis udvikling er baseret p&aring; at lytte til kunderne, og det b&oslash;r dit valg af CMS ogs&aring; v&aelig;re. Tuksibrugeres vurdering af produktet, kan hj&aelig;lpe dig med at beslutte, om Tuksi er en mulighed for din organisation. Det er tit en bedre id&eacute; at lytte til s&aelig;lgerens kunder end til s&aelig;lgeren selv&hellip;</div>',200,NULL,NULL,'','2009-02-18 13:26:04','','1','Hjemmesider uden hovedpine',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,16,'frontend'),(375,17,103,185,1,NULL,'Lorem ipsum (Dwarf A/S)','Dette firma ved hvad de snakker om ',200,NULL,NULL,NULL,'2009-02-10 11:52:46',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,204,'frontend'),(548,16,56,264,1,NULL,NULL,NULL,100,NULL,NULL,NULL,'2008-06-17 16:17:56',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,287,'backend'),(549,17,4,264,0,'Billede',NULL,NULL,100,'pg_content/549_image_2710.jpg',NULL,'file:1','0000-00-00 00:00:00',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,1,1,0,'frontend'),(550,16,56,265,1,NULL,NULL,NULL,100,NULL,NULL,NULL,'2008-06-17 16:17:56',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,288,'backend'),(551,17,4,265,0,NULL,NULL,NULL,50,NULL,NULL,NULL,'0000-00-00 00:00:00',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,1,1,0,'frontend'),(552,16,56,266,1,NULL,NULL,NULL,100,NULL,NULL,NULL,'2008-06-17 16:17:56',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,289,'frontend'),(553,16,56,267,1,NULL,NULL,NULL,100,NULL,NULL,NULL,'2008-06-17 16:17:56',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NU