 dig med at finde frem til den l&oslash;sning, som passer til netop din virksomhed. Vi g&oslash;r dig opm&aelig;rksom p&aring; muligheder og begr&aelig;nsninger, du m&aring;ske ikke selv har t&aelig;nkt over. Og vi kan give dig en fast pris p&aring; hele l&oslash;sningen, s&aring; du ikke f&aring;r ubehagelige overraskelser senere.</div>',100,NULL,NULL,NULL,'0000-00-00 00:00:00',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,'frontend'),(12289,3,41,9742,1,NULL,'6',NULL,100,NULL,NULL,NULL,'0000-00-00 00:00:00','6',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,'frontend'),(12282,3,9,9701,1,'',NULL,'\r\n\r\n<div>Tuksi er bygget op i moduler, der gør dit site enkelt og overskueligt. Det giver mulighed for at skræddersy en løsning helt efter dine behov. Det er selvfølgelig til enhver tid muligt at udvide en eksisterende Tuksi-løsning ved tilkøb af moduler - i den takt behovene opstår. Og dækker de eksisterende moduler ikke dine konkrete behov, har vi i samarbejde med vores partnere mulighed for at tilbyde kundespecifikke løsninger efter dine krav og ideer. </div>',100,'0',NULL,NULL,'0000-00-00 00:00:00',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,'frontend'),(12224,3,9,9695,1,'',NULL,'Du kan redigere hjemmesider med Tuksi, uanset hvor i verden du befinder dig. Blot du har adgang til en computer med internetadgang. <br />\r\n&nbsp;<br />\r\nTuksi giver mulighed for, at hver bruger kan tildeles forskellige rettigheder. Afhængigt af, hvordan dine rettigheder er sat op, vil du få forskellige menupunkter at se, når du logger ind.',100,NULL,NULL,NULL,'0000-00-00 00:00:00',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,'frontend'),(12225,3,4,9695,1,NULL,NULL,NULL,200,'pg_content/12225_image_3544_1.jpg',NULL,NULL,'0000-00-00 00:00:00',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,'frontend'),(12227,3,9,9704,1,'',NULL,'Tuksi er bygget op ligesom Stifinder i Windows. De let forståelige menuer gør det nemt at arbejde med Tuksi.',100,NULL,NULL,NULL,'0000-00-00 00:00:00',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,'frontend'),(12234,3,9,9709,1,'',NULL,'\r\n\r\n<div>Tuksi giver mulighed for at oprette ligeså mange niveauer og grupper, du ønsker. Således kan den enkelte redaktør tildeles de rettigheder, der er passende for den arbejdsopgave, der skal løses. Du kan markére med flueben, hvilke rettigheder brugerne skal have.</div>',100,'0',NULL,NULL,'0000-00-00 00:00:00',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,'frontend'),(12228,3,4,9704,1,NULL,NULL,NULL,200,'pg_content/12228_image_1010_1.jpg',NULL,NULL,'0000-00-00 00:00:00',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,'frontend'),(12229,3,9,9705,1,'',NULL,'Tekstfelter med tilhørende forklaringer gør det let at finde de informationer, der skal opdateres.',100,NULL,NULL,NULL,'0000-00-00 00:00:00',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,'frontend'),(12232,3,9,9710,1,'',NULL,'Teksten i Tuksi formateres ved tryk på simple knapper som vi kender dem fra Word. Klik f.eks. på \r\n\r\n<span style=\"text-decoration: underline;\">U</span> for at \r\n\r\n<span style=\"text-decoration: underline;\">understrege</span> teksten eller \r\n<span style=\"font-style: italic;\">I</span> for at sætte enkelte ord eller passager i kursiv. ',100,'609',NULL,NULL,'0000-00-00 00:00:00',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,'frontend'),(12233,3,9,9707,1,'',NULL,'Du kan altid se, hvilke billeder som hører sammen med hvilken tekst. Nye billeder findes ligesom i Windows Stifinder. At arbejde med billeder og tekst bliver legende let med Tuksi. ',100,NULL,NULL,NULL,'0000-00-00 00:00:00',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,'frontend'),(12230,3,4,9705,1,NULL,NULL,NULL,200,'pg_content/12230_image_3854_1.jpg',NULL,NULL,'0000-00-00 00:00:00',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,'frontend'),(12235,3,9,9711,1,'',NULL,'Med Tuksis billed-editor kan redaktøren nemt og hurtigt hente et billede, vælge det ønskede udsnit og derefter beskære billedet.<br />\r\n&nbsp;<br />\r\nModulet kan også bruges til at skalere billedet til den rigtige størrelse. På den måde kan en redaktør med et almindeligt kendskab til eksempelvis Word og mail-programmer vedligeholde&nbsp;avancerede, billedtunge sites.',100,NULL,NULL,NULL,'0000-00-00 00:00:00',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,'frontend'),(12266,3,9,9692,1,'',NULL,'<strong>To versioner af TUKSI<br />\r\n	</strong>Tuksi findes i to versioner: en til Windows NT og en til Linux. Windows NT-udgaven er udviklet til kunder, der har en politik om kun at anvende Microsoft-produkter. Linux-versionen bygger på open source, så andre programmører kan arbejde videre med systemet.<br />\r\n&nbsp;<br />\r\n<b style=\"mso-bidi-font-weight: normal\">Programmeringssprog og databaser</b><br />\r\nI Linux versionen er programmeringssproget PHP. Hjemmesidens indhold ligger i databasen MySQL. I Windows NT-udgaven er programmeringssproget ASP. Her ligger indholdet i databasen MSSQL. <br />\r\n&nbsp;<br />\r\n<b style=\"mso-bidi-font-weight: normal\">Placering af server</b><br />\r\nTuksi-løsningen kan enten placeres på kundens egen server eller på en af Dwarfs fælles servere hos den professionelle udbyder UNI2. UNI2 vedligeholder serveren og sikrer, at ingen data går tabt, også selvom hele landet skulle blive ramt af strømsvigt.<br />\r\n&nbsp;<br />\r\n<b style=\"mso-bidi-font-weight: normal\">Anbefaling af serverløsning</b><br />\r\nVed små og mellemstore løsninger anbefaler vi Dwarfs fælles servere hos UNI2. Ved store løsninger som f.eks. ILVA eller Rockfon sørger Dwarf typisk for opstilling af en eller flere servere, som kun betjener den kunde. Også ved de store løsninger anbefaler vi, at UNI2 står for drift- og vedligeholdelse.',100,NULL,NULL,NULL,'0000-00-00 00:00:00',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,'frontend'),(12236,3,9,9712,1,'',NULL,'\r\n\r\n<div>Standardpakken giver mulighed for at vedligeholde tekst, billeder, kontakt formularer, e-mails og links til andre sites. </div>',100,NULL,NULL,NULL,'0000-00-00 00:00:00',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,'frontend'),(12237,3,4,9712,1,NULL,NULL,NULL,200,'pg_content/12237_image_6790_1.jpg',NULL,NULL,'0000-00-00 00:00:00',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,'frontend'),(12238,3,9,9713,1,'',NULL,'\r\n\r\n<div><strong>Mulighederne er mange</strong></div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>Søgemodulet kan sættes op på mange måder, lige fra en simpel sidesøgning til avanceret tekst- og kriteriesøgning. </div>',100,NULL,NULL,NULL,'0000-00-00 00:00:00',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,'frontend'),(12239,3,9,9714,1,'',NULL,'\r\n\r\n<div><strong>Fleksibilitet er vigtigt</strong></div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>Søgeresultatet kan sættes op, så det præsenteres som tekstsider eller kombinationssider med både billeder og tekst.</div>',100,NULL,NULL,NULL,'0000-00-00 00:00:00',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,'frontend'),(12240,3,9,9715,1,'',NULL,'\r\n\r\n<div>\r\n	<span style=\"font-weight: bold;\">En lille hilsen skrevet af kunderne</span></div>\r\n\r\n\r\n<div> </div>\r\n\r\n\r\n<div>Gæstebogsmodulet kan bruges til feedback og simple linære diskussioner. </div>',100,NULL,NULL,NULL,'0000-00-00 00:00:00',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,'frontend'),(12241,3,9,9716,1,'asdsadas \'\'as d\\ sads ad\'as dsadsad',NULL,'<a target=\"_self\" href=\"/da/valg_af_cms.html\">hassa</a><br />\r\n\r\n',100,'0',NULL,NULL,'0000-00-00 00:00:00',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,'frontend'),(12242,3,9,9717,1,'',NULL,'\r\n\r\n<div><strong>Styring af elektroniske nyhedsbreve</strong></div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>Nyhedsbrevsmodulet håndterer den elektroniske dialog med dine kunder. Modulet kan sættes op med forskellige grupper.<br />\r\n	&nbsp;<br />\r\n	Fra&nbsp;Tuksi kan grupperne administreres, ligesom den kan bruges til at opsætte og udsende HTML- og almindelige nyhedsbreve. <br />\r\n	</div>\r\n\r\n<div>Børsens nyhedsbrevsservice gør det endvidere muligt for brugeren at få tilsendt nyheder og sammendrag af nyheder på nøjagtig det tidspunkt af døgnet, der ønskes. </div>',100,NULL,NULL,NULL,'0000-00-00 00:00:00',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,'frontend'),(12243,3,9,9718,1,'',NULL,'\r\n\r\n<div><strong>Udsendelse af nyhedsbreve via e-mail</strong></div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>Ved brug af HTML-mailfunktionen kan den&nbsp;e-mail, brugeren modtager, sættes op, så den ligner den øvrige grafiske profil. </div>',100,NULL,NULL,NULL,'0000-00-00 00:00:00',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,'frontend'),(12244,3,9,9719,1,'',NULL,'\r\n\r\n<div><strong>Bestilling af materialer og brochurer </strong></div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>Med Bestillingsmodulet kan kunderne få overblik over og bestille trykte materialer, publikationer, vareprøver etc. direkte via nettet. </div>',102,NULL,NULL,NULL,'0000-00-00 00:00:00',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,'frontend'),(12245,3,9,9720,1,'',NULL,'\r\n\r\n<div><strong>Adgangskontrol via password-styring</strong></div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>Med Login-modulet kan adgangen, til eksempelvis presseområder eller en shop for godkendte kunder, styres.</div>',100,NULL,NULL,NULL,'0000-00-00 00:00:00',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,'frontend'),(12246,3,9,9721,1,'',NULL,'\r\n\r\n<div><strong>Dynamisk flash kan styres direkte fra Tuksi</strong></div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>Via Tuksi kanSDsadsadsad</div>',100,NULL,NULL,NULL,'0000-00-00 00:00:00',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,'frontend'),(12319,5,12,9775,1,NULL,NULL,NULL,100,NULL,NULL,NULL,'0000-00-00 00:00:00','ale@dwarf.dk','Kontakt fra hjemmeside','cmstree:9695',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,'frontend'),(12247,3,9,9723,1,'',NULL,'\r\n\r\n<div>\r\n	\r\n	<span style=\"font-weight: bold;\">E-handel simpelt og hurtigt </span></div>\r\n\r\n\r\n\r\n<div> </div>\r\n\r\n\r\n\r\n<div>Med Shopmodulet kan du opsætte og vedligeholde en shop, som både er overskuelig og hurtig at bruge. <br />\r\n	\r\n	\r\n	<br />\r\n	\r\n	\r\n	Shoppen kan enten være baseret på faktura B2B-modellen eller koblet til betalingskort-gateway, som det typisk ses på B2C-markedet. </div>',102,NULL,NULL,NULL,'0000-00-00 00:00:00',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,'frontend'),(12248,3,9,9722,1,'',NULL,'\r\n\r\n<div><strong>Grafikmodulet kan illustrere \"alt\"</strong></div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>Via Tuksi kan tal illustreres i grafer og diagrammer efter behov. Når modulet er sat op, er komplicerede sammenhænge lette at illustrere.</div>',100,NULL,NULL,NULL,'0000-00-00 00:00:00',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,'frontend'),(12249,3,9,9724,1,'',NULL,'\r\n\r\n<div><strong>Brug websitet uden internetadgang</strong></div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>Som noget helt specielt har Tuksi et offlinemodul, som gør det muligt at producere en komplet kopi af en avanceret databasedreven webplatform og lægge den på en cd-rom.<br />\r\n	&nbsp;<br />\r\n	Dette er genialt til salgspræsentationer, hvor sælgerne ikke behøver internetadgang til deres bærbare computere. <br />\r\n	&nbsp;<br />\r\n	Eller ved udsendelse til kunder, som skal bruge det som et dagligt værktøj.</div>',100,NULL,NULL,NULL,'0000-00-00 00:00:00',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,'frontend'),(12250,3,9,9725,1,'',NULL,'\r\n\r\n<div><strong>Direkte adgang til opdateret statistik</strong></div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>Tuksi giver direkte adgang til opdateret statistik over, hvad der foregår på webplatformen. <br />\r\n	&nbsp;<br />\r\n	Statistikmodulet bruger Urchins internationalt anerkendte statistikmotor.</div>',100,NULL,NULL,NULL,'0000-00-00 00:00:00',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,'frontend'),(12314,3,4,9772,1,NULL,NULL,NULL,100,'pg_content/12314_image_7598_1.jpg',NULL,NULL,'0000-00-00 00:00:00',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,'frontend'),(12315,3,9,9773,1,'',NULL,'\r\n\r\n<p>Før du beslutter dig for et Content Management System, bør du finde ud af, hvilke krav systemet skal opfylde. Ikke bare i dag, men også i de nærmeste år. Vælger du et system, som ikke giver mulighed for udvidelser, risikerer du at skulle begynd<a href=\"/downloads/58/__iam.jpg\" target=\"_self\">e forfra med et andet system o</a>m få år. Her er nogle eksempler på krav, du kan overveje:<br />\r\n	\r\n	\r\n	\r\n	 <br />\r\n	\r\n	\r\n	\r\n	\r\n	\r\n	\r\n	<span style=\"font-weight: bold;\">Krav til brugervenlighed</span><br />\r\n	\r\n	\r\n	\r\n	<br />\r\n	\r\n	\r\n	\r\n	</p>\r\n\r\n\r\n<span style=\"font-weight: bold;\"></span>\r\n\r\n\r\n\r\n\r\n<div>\r\n	\r\n	\r\n	<span style=\"font-weight: bold;\"></span></div>\r\n\r\n\r\n\r\n\r\n<ul>\r\n	\r\n\r\n	\r\n	\r\n	<li>\r\n		\r\n\r\n		\r\n		\r\n		<div>\r\n			\r\n			\r\n			<span style=\"font-weight: bold;\">Adgang:</span> Kan systemet administreres fra alle computere med internetadgang, ligegyldigt hvor de befinder sig i verden?<br />\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			<span style=\"font-weight: bold;\"></span></div></li>\r\n	\r\n\r\n	\r\n	\r\n	<li>\r\n		\r\n\r\n		\r\n		\r\n		<div>\r\n			\r\n			\r\n			<span style=\"font-weight: bold;\">Uddannelse:</span> Kræver systemet efteruddannelse af personalet, eller kan I med det samme gå i gang med at redigere hjemmesidens indhold?<br />\r\n			\r\n			\r\n			\r\n			</div>\r\n		\r\n		\r\n		<span style=\"font-weight: bold;\"></span></li>\r\n	\r\n\r\n	\r\n	\r\n	<li>\r\n		\r\n		\r\n		<span style=\"font-weight: bold;\">Layout:</span> Er indhold og layout adskilt i systemet, så man kan ændre hjemmesidens grafiske design uden at skulle ændre hver enkelt side?<br />\r\n		\r\n		\r\n		\r\n		\r\n		\r\n		\r\n		<span style=\"font-weight: bold;\"></span></li>\r\n	\r\n\r\n	\r\n	\r\n	<li>\r\n		\r\n		\r\n		<span style=\"font-weight: bold;\">Metadata:</span> Giver systemet mulighed for at forsyne hjemmesidens indhold med etiketter, som brugerne kan søge på, f.eks. sofaer eller børnesenge?<br />\r\n		\r\n		\r\n		\r\n		\r\n		\r\n		\r\n		<span style=\"font-weight: bold;\"></span></li>\r\n	\r\n\r\n	\r\n	\r\n	<li>\r\n		\r\n		\r\n		<span style=\"font-weight: bold;\">Brugerrettigheder:</span> Giver systemet mulighed for at forskellige brugere kan få forskellige rettigheder?<br />\r\n		\r\n		\r\n		\r\n		\r\n		\r\n		\r\n		<span style=\"font-weight: bold;\"></span></li>\r\n	\r\n\r\n	\r\n	\r\n	<li>\r\n		\r\n		\r\n		<span style=\"font-weight: bold;\">Videndeling:</span> Kan systemet bruges til at gøre viden tilgængelig for alle i virksomheden?<br />\r\n		\r\n		\r\n		\r\n		\r\n		\r\n		\r\n		<span style=\"font-weight: bold;\"></span></li>\r\n	\r\n\r\n	\r\n	\r\n	<li>\r\n		\r\n		\r\n		<span style=\"font-weight: bold;\">Prøveperiode:</span> Er der mulighed for, at du kan afprøve systemet, inden du beslutter dig for at købe det?<br />\r\n		\r\n		\r\n		\r\n		 <br />\r\n		\r\n		\r\n		\r\n		\r\n		\r\n		\r\n		<span style=\"font-weight: bold;\"></span></li>\r\n\r\n\r\n\r\n</ul>\r\n\r\n\r\n\r\n\r\n<p>\r\n	\r\n	\r\n	<span style=\"font-weight: bold;\">Krav til teknik</span><br />\r\n	\r\n	\r\n	\r\n	<br />\r\n	\r\n	\r\n	\r\n	</p>\r\n\r\n\r\n<span style=\"font-weight: bold;\"></span>\r\n\r\n\r\n\r\n\r\n<ul>\r\n	\r\n\r\n	\r\n	\r\n	<li>\r\n		\r\n\r\n		\r\n		\r\n		<div>\r\n			\r\n			\r\n			<span style=\"font-weight: bold;\">Genbrug:</span> Giver systemet mulighed for at genbruge indhold, f.eks. i artikler og nyhedsbreve?<br />\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			<span style=\"font-weight: bold;\"></span></div></li>\r\n	\r\n\r\n	\r\n	\r\n	<li>\r\n		\r\n\r\n		\r\n		\r\n		<div>\r\n			\r\n			\r\n			<span style=\"font-weight: bold;\">Platform:</span> Virker hjemmesiden, uanset hvilket styresystem og hvilke browsere virksomheden og dens brugere benytter?</div></li>\r\n	\r\n\r\n	\r\n	\r\n	<li>\r\n		\r\n		\r\n		<span style=\"font-weight: bold;\">Software:</span> Kan systemet kommunikere med virksomhedens andre computersystemer, f.eks. regnskabsprogrammet, billeddatabasen eller kundekartoteket?<br />\r\n		\r\n		\r\n		\r\n		\r\n		\r\n		\r\n		<span style=\"font-weight: bold;\"></span></li>\r\n	\r\n\r\n	\r\n	\r\n	<li>\r\n		\r\n		\r\n		<span style=\"font-weight: bold;\">Søgemaskineoptimering:</span> Tager systemet højde for, at din hjemmeside skal kunne findes af søgemaskiner som f.eks. Google?<br />\r\n		\r\n		\r\n		\r\n		\r\n		\r\n		\r\n		<span style=\"font-weight: bold;\"></span></li>\r\n	\r\n\r\n	\r\n	\r\n	<li>\r\n		\r\n		\r\n		<span style=\"font-weight: bold;\">Migrering:</span> Gør systemet det let at flytte indhold fra en eksisterende hjemmeside over i den nye hjemmeside?<br />\r\n		\r\n		\r\n		\r\n		\r\n		\r\n		\r\n		<span style=\"font-weight: bold;\"></span></li>\r\n	\r\n\r\n	\r\n	\r\n	<li>\r\n		\r\n		\r\n		<span style=\"font-weight: bold;\">Skalering:</span> Kan systemet udvides til f.eks. at omfatte websites på flere forskellige sprog?<br />\r\n		\r\n		\r\n		\r\n		\r\n		\r\n		\r\n		<span style=\"font-weight: bold;\"></span></li>\r\n	\r\n\r\n	\r\n	\r\n	<li>\r\n		\r\n\r\n		\r\n		\r\n		<div>\r\n			\r\n			\r\n			<span style=\"font-weight: bold;\">Kildekode:</span> Bruger systemet open source, så du ikke er stavnsbundet til en bestemt samarbejdspartner i fremtiden</div></li>\r\n\r\n\r\n\r\n</ul>\r\n\r\n\r\n\r\n\r\n<p> </p>\r\n\r\n\r\n\r\n\r\n<p>\r\n	\r\n	\r\n	<span style=\"font-weight: bold;\">Tuksi opfylder alle disse krav!</span><br />\r\n	\r\n	\r\n	\r\n	</p>',100,NULL,NULL,NULL,'0000-00-00 00:00:00',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,'frontend'),(12252,3,9,9727,1,'',NULL,'\r\n\r\n<div><strong>Konkurrencer uden besvær</strong></div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>Via Konkurrencemodulet er det muligt selv at opsætte komplekse konkurrencer ved, på kryds og tværs, at vælge de elementer og parametre konkurrencen skal indeholde.<br />\r\n	&nbsp;<br />\r\n	Deltagere registreres automatisk og kan ses direkte i Tuksi. </div>',100,NULL,NULL,NULL,'0000-00-00 00:00:00',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,'frontend'),(12253,3,4,9713,1,NULL,NULL,NULL,200,'pg_content/12253_image_4425_1.jpg',NULL,NULL,'0000-00-00 00:00:00',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,'frontend'),(12254,3,4,9715,1,NULL,NULL,NULL,200,'pg_content/12254_image_2619_1.jpg',NULL,NULL,'0000-00-00 00:00:00',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,'frontend'),(12255,3,4,9718,1,NULL,NULL,NULL,200,'pg_content/12255_image_3255_1.jpg',NULL,NULL,'0000-00-00 00:00:00',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,'frontend'),(12256,3,4,9719,1,NULL,NULL,NULL,101,'pg_content/12256_image_2227_1.jpg',NULL,NULL,'0000-00-00 00:00:00',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,'frontend'),(12257,3,4,9720,1,NULL,NULL,NULL,200,'pg_content/12257_image_5245_1.jpg',NULL,NULL,'0000-00-00 00:00:00',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,'frontend'),(12258,3,4,9721,1,NULL,NULL,NU