de befinder sig i verden?<br />\r\n			<strong></strong></div></li>\r\n	\r\n<li>\r\n		\r\n<div><strong>Uddannelse:</strong> Kræver systemet efteruddannelse af personalet, eller kan I med det samme gå i gang med at redigere hjemmesidens indhold?<br />\r\n			</div><b style=\"mso-bidi-font-weight: normal\"></b></li>\r\n	\r\n<li><b style=\"mso-bidi-font-weight: normal\">Layout:</b> Er indhold og layout adskilt i systemet, så man kan ændre hjemmesidens grafiske design uden at skulle ændre hver enkelt side?<br />\r\n		<b style=\"mso-bidi-font-weight: normal\"></b></li>\r\n	\r\n<li><b style=\"mso-bidi-font-weight: normal\">Metadata:</b> Giver systemet mulighed for at forsyne hjemmesidens indhold med etiketter, som brugerne kan søge på, f.eks. sofaer eller børnesenge?<br />\r\n		<b style=\"mso-bidi-font-weight: normal\"></b></li>\r\n	\r\n<li><b style=\"mso-bidi-font-weight: normal\">Brugerrettigheder:</b> Giver systemet mulighed for at forskellige brugere kan få forskellige rettigheder?<br />\r\n		<b style=\"mso-bidi-font-weight: normal\"></b></li>\r\n	\r\n<li><b style=\"mso-bidi-font-weight: normal\">Videndeling:</b> Kan systemet bruges til at gøre viden tilgængelig for alle i virksomheden?<br />\r\n		<b style=\"mso-bidi-font-weight: normal\"></b></li>\r\n	\r\n<li><b style=\"mso-bidi-font-weight: normal\">Prøveperiode:</b> Er der mulighed for, at du kan afprøve systemet, inden du beslutter dig for at købe det?<br />\r\n		&nbsp;<br />\r\n		<strong></strong></li>\r\n</ul>\r\n\r\n<p><strong>Krav til teknik</strong><br />\r\n	<br />\r\n	</p><b style=\"mso-bidi-font-weight: normal\"></b>\r\n\r\n<ul>\r\n	\r\n<li>\r\n		\r\n<div><b style=\"mso-bidi-font-weight: normal\">Genbrug:</b> Giver systemet mulighed for at genbruge indhold, f.eks. i artikler og nyhedsbreve?<br />\r\n			<strong></strong></div></li>\r\n	\r\n<li>\r\n		\r\n<div><strong>Platform:</strong> Virker hjemmesiden, uanset hvilket styresystem og hvilke browsere virksomheden og dens brugere benytter?</div></li>\r\n	\r\n<li><b style=\"mso-bidi-font-weight: normal\">Software:</b> Kan systemet kommunikere med virksomhedens andre computersystemer, f.eks. regnskabsprogrammet, billeddatabasen eller kundekartoteket?<br />\r\n		<b style=\"mso-bidi-font-weight: normal\"></b></li>\r\n	\r\n<li><b style=\"mso-bidi-font-weight: normal\">Søgemaskineoptimering:</b> Tager systemet højde for, at din hjemmeside skal kunne findes af søgemaskiner som f.eks. Google?<br />\r\n		<b style=\"mso-bidi-font-weight: normal\"></b></li>\r\n	\r\n<li><b style=\"mso-bidi-font-weight: normal\">Migrering:</b> Gør systemet det let at flytte indhold fra en eksisterende hjemmeside over i den nye hjemmeside?<br />\r\n		<b style=\"mso-bidi-font-weight: normal\"></b></li>\r\n	\r\n<li><b style=\"mso-bidi-font-weight: normal\">Skalering:</b> Kan systemet udvides til f.eks. at omfatte websites på flere forskellige sprog?<br />\r\n		<b style=\"mso-bidi-font-weight: normal\"></b></li>\r\n	\r\n<li>\r\n		\r\n<div><b style=\"mso-bidi-font-weight: normal\">Kildekode:</b> Bruger systemet open source, så du ikke er stavnsbundet til en bestemt samarbejdspartner i fremtiden</div></li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><b style=\"mso-bidi-font-weight: normal\">Tuksi opfylder alle disse krav!</b><br />\r\n	</p>',100,NULL,NULL,NULL,'0000-00-00 00:00:00',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,'frontend'),(12317,3,12,9724,0,NULL,NULL,NULL,300,NULL,NULL,NULL,'0000-00-00 00:00:00',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,'frontend'),(12320,16,46,2,1,NULL,NULL,NULL,100,NULL,NULL,NULL,'0000-00-00 00:00:00',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,'frontend'),(12321,16,47,136,1,NULL,NULL,NULL,100,NULL,NULL,NULL,'0000-00-00 00:00:00','cmsfile','','select * from cmsfile order by filename','insert into cmsfile (filename) values(\')',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,'frontend'),(12322,16,57,13,1,NULL,NULL,NULL,100,NULL,NULL,NULL,'0000-00-00 00:00:00','','','','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,'frontend'),(12347,16,49,112,1,NULL,NULL,NULL,100,NULL,NULL,NULL,'0000-00-00 00:00:00',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,'frontend'),(12440,3,9,9777,1,'asdasdasdsad',NULL,'<div><span style=\"font-weight: bold;\">Definition</span><br />\r\nEt Content Management System er beregnet til at styre og redigere indholdet p&aring; en hjemmeside. Indholdet vil typisk v&aelig;re tekster og billeder, men det kan i princippet v&aelig;re hvad som helst. F.eks. kan vi p&aring; webbureauet Dwarfs intranet styre en diskokugle, vi har siddende i loftet.<br />\r\n<br />\r\n<span style=\"font-weight: bold;\">En jungle af systemer</span><br />\r\nDer findes over 100 Content Management Systemer i Danmark og over 1000 p&aring; verdensplan. En CMS-l&oslash;sning fra en stor, udenlandsk leverand&oslash;r kan l&oslash;be op i flere millioner kroner. Omvendt findes der danske pakkel&oslash;sninger til n&aelig;sten ingen penge. <br />\r\n<br />\r\n<span style=\"font-weight: bold;\">Billigt kan blive dyrt</span><br />\r\nN&aring;r du skal v&aelig;lge et Content Management System til din virksomhed, skal du ikke kun se p&aring; anskaffelsesprisen. Ofte vil den billigste l&oslash;sning ende med at blive meget dyrere, inden systemet er rettet til, s&aring; det passer til din virksomhed.<br />\r\n<br />\r\n<span style=\"font-weight: bold;\">Fast pris hos Tuksi</span></div>\r\n<div>Hos Tuksi hj&aelig;lper vi dig med at finde frem til den l&oslash;sning, som passer til netop din virksomhed. Vi g&oslash;r dig opm&aelig;rksom p&aring; muligheder og begr&aelig;nsninger, du m&aring;ske ikke selv har t&aelig;nkt over. Og vi kan give dig en fast pris p&aring; hele l&oslash;sningen, s&aring; du ikke f&aring;r ubehagelige overraskelser senere.</div>',100,NULL,NULL,NULL,'0000-00-00 00:00:00',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,'frontend'),(12325,16,48,9,1,NULL,NULL,NULL,100,NULL,NULL,NULL,'0000-00-00 00:00:00',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,'frontend'),(12326,16,47,167,1,NULL,NULL,NULL,100,NULL,NULL,NULL,'0000-00-00 00:00:00','pg_module','','SELECT * FROM pg_module ORDER BY name','INSERT INTO pg_module (name, moduletype) VALUES(\'?\', \'standard\')',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,'frontend'),(12427,18,5,238,0,'',NULL,NULL,100,NULL,NULL,NULL,'2007-11-13 13:03:16',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,'frontend'),(12437,18,5,9691,0,NULL,NULL,NULL,100,NULL,NULL,NULL,'2007-11-13 16:43:31',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,'frontend'),(12346,16,47,9769,0,NULL,NULL,NULL,100,NULL,NULL,NULL,'0000-00-00 00:00:00','cmspoll','','SELECT * FROM cmspoll order by dateadded','INSERT INTO (dateadded) VALUES (now())',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,'frontend'),(12344,16,54,461,1,NULL,NULL,NULL,100,NULL,NULL,NULL,'0000-00-00 00:00:00','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,'frontend'),(12341,16,53,208,1,NULL,NULL,NULL,100,NULL,NULL,NULL,'0000-00-00 00:00:00',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,'frontend'),(12343,16,54,143,1,NULL,NULL,NULL,100,NULL,NULL,NULL,'0000-00-00 00:00:00',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,'frontend'),(12340,16,47,33,1,NULL,NULL,NULL,100,NULL,NULL,NULL,'0000-00-00 00:00:00','cmsfieldtype','','Select * from cmsfieldtype order by name','INSERT INTO cmsfieldtype (name) VALUES (\'--new--\')',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,'frontend'),(12387,3,9,238,1,'zxvzfvxzc',NULL,'vxcxczvzxcvxzcv',300,NULL,NULL,NULL,'0000-00-00 00:00:00',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,'frontend'),(12389,18,9,238,1,'',NULL,NULL,200,NULL,NULL,N