),(12512,3,9,9789,1,'zxvzfvxzc',NULL,'vxcxczvzxcvxzcv',400,NULL,NULL,NULL,'0000-00-00 00:00:00',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,'frontend'),(12513,3,9,9789,0,'',NULL,NULL,500,NULL,NULL,NULL,'2007-11-12 16:54:49',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,'frontend'),(12514,3,9,9791,1,'asdasdasdsad',NULL,'<div><span style=\"font-weight: bold;\">Definition</span><br />\r\nEt Content Management System er beregnet til at styre og redigere indholdet p&aring; en hjemmeside. Indholdet vil typisk v&aelig;re tekster og billeder, men det kan i princippet v&aelig;re hvad som helst. F.eks. kan vi p&aring; webbureauet Dwarfs intranet styre en diskokugle, vi har siddende i loftet.<br />\r\n<br />\r\n<span style=\"font-weight: bold;\">En jungle af systemer</span><br />\r\nDer findes over 100 Content Management Systemer i Danmark og over 1000 p&aring; verdensplan. En CMS-l&oslash;sning fra en stor, udenlandsk leverand&oslash;r kan l&oslash;be op i flere millioner kroner. Omvendt findes der danske pakkel&oslash;sninger til n&aelig;sten ingen penge. <br />\r\n<br />\r\n<span style=\"font-weight: bold;\">Billigt kan blive dyrt</span><br />\r\nN&aring;r du skal v&aelig;lge et Content Management System til din virksomhed, skal du ikke kun se p&aring; anskaffelsesprisen. Ofte vil den billigste l&oslash;sning ende med at blive meget dyrere, inden systemet er rettet til, s&aring; det passer til din virksomhed.<br />\r\n<br />\r\n<span style=\"font-weight: bold;\">Fast pris hos Tuksi</span></div>\r\n<div>Hos Tuksi hj&aelig;lper vi dig med at finde frem til den l&oslash;sning, som passer til netop din virksomhed. Vi g&oslash;r dig opm&aelig;rksom p&aring; muligheder og begr&aelig;nsninger, du m&aring;ske ikke selv har t&aelig;nkt over. Og vi kan give dig en fast pris p&aring; hele l&oslash;sningen, s&aring; du ikke f&aring;r ubehagelige overraskelser senere.</div>',100,NULL,NULL,NULL,'0000-00-00 00:00:00',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,'frontend'),(12515,1,9,9791,1,'dfadsf',NULL,'adsfasdfasas',100,NULL,NULL,NULL,'0000-00-00 00:00:00',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,'frontend'),(12516,18,5,9791,0,NULL,NULL,NULL,100,'',NULL,NULL,'2007-11-13 16:43:31',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,'frontend'),(12517,16,56,9791,1,NULL,NULL,NULL,100,NULL,NULL,NULL,'2007-11-13 14:12:11',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,'frontend'),(12518,3,9,9792,1,'asdasdasdsad',NULL,'<div><span style=\"font-weight: bold;\">Definition</span><br />\r\nEt Content Management System er beregnet til at styre og redigere indholdet p&aring; en hjemmeside. Indholdet vil typisk v&aelig;re tekster og billeder, men det kan i princippet v&aelig;re hvad som helst. F.eks. kan vi p&aring; webbureauet Dwarfs intranet styre en diskokugle, vi har siddende i loftet.<br />\r\n<br />\r\n<span style=\"font-weight: bold;\">En jungle af systemer</span><br />\r\nDer findes over 100 Content Management Systemer i Danmark og over 1000 p&aring; verdensplan. En CMS-l&oslash;sning fra en stor, udenlandsk leverand&oslash;r kan l&oslash;be op i flere millioner kroner. Omvendt findes der danske pakkel&oslash;sninger til n&aelig;sten ingen penge. <br />\r\n<br />\r\n<span style=\"font-weight: bold;\">Billigt kan blive dyrt</span><br />\r\nN&aring;r du skal v&aelig;lge et Content Management System til din virksomhed, skal du ikke kun se p&aring; anskaffelsesprisen. Ofte vil den billigste l&oslash;sning ende med at blive meget dyrere, inden systemet er rettet til, s&aring; det passer til din virksomhed.<br />\r\n<br />\r\n<span style=\"font-weight: bold;\">Fast pris hos Tuksi</span></div>\r\n<div>Hos Tuksi hj&aelig;lper vi dig med at finde frem til den l&oslash;sning, som passer til netop din virksomhed. Vi g&oslash;r dig opm&aelig;rksom p&aring; muligheder og begr&aelig