&aring;tte v&aelig;lge en anden samarbejdspartner end Dwarf.',200,'0',NULL,NULL,'0000-00-00 00:00:00',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,'frontend'),(12604,16,56,9801,1,NULL,NULL,NULL,100,NULL,NULL,NULL,'0000-00-00 00:00:00',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,'frontend'),(12605,5,12,9801,1,NULL,NULL,NULL,100,NULL,NULL,NULL,'0000-00-00 00:00:00','asdasdasdas','asdfasdfasdf','cmstree:9774',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,'frontend'),(12606,18,5,9801,0,NULL,NULL,NULL,100,'',NULL,NULL,'2007-11-13 13:03:16',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,'frontend'),(12607,3,9,9801,1,'sddsds f3673',NULL,NULL,100,NULL,NULL,NULL,'0000-00-00 00:00:00',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,'frontend'),(12608,5,12,9801,1,NULL,NULL,NULL,200,NULL,NULL,NULL,'0000-00-00 00:00:00','asdfsdsdfsdfsd','sadfsadf',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,'frontend'),(12609,18,9,9801,0,'',NULL,NULL,200,NULL,NULL,NULL,'0000-00-00 00:00:00',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,'frontend'),(12610,3,9,9801,0,'otooto',NULL,NULL,200,NULL,NULL,NULL,'0000-00-00 00:00:00',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,'frontend'),(12611,5,12,9801,1,NULL,NULL,NULL,300,NULL,NULL,NULL,'0000-00-00 00:00:00','sadf','asdfasdf','cmstree:9710',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,'frontend'),(12612,3,9,9801,0,'test test',NULL,NULL,300,NULL,NULL,NULL,'0000-00-00 00:00:00',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,'frontend'),(12613,3,9,9801,1,'zxvzfvxzc',NULL,'vxcxczvzxcvxzcv',400,NULL,NULL,NULL,'0000-00-00 00:00:00',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,'frontend'),(12614,3,9,9801,0,'',NULL,NULL,500,NULL,NULL,NULL,'2007-11-12 16:54:49