.jpg',NULL,NULL,'2009-02-18 13:52:11','Lorem ipsum dolor sit amet, consectetur','Lorem ipsum dolor sit amet, consectetur adipiscing elit. Suspendisse non nulla id purus rutrum pellentesque. Fusce dignissim, ipsum ut faucibus porta, dui libero laoreet adipiscing elit. Suspendisse non nulla id purus rutrum ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'asdfasdfasdf',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,88,'frontend'),(525,17,9,81,1,'asdasdasdsa',NULL,'<div class=\"mTextImageLeft\">\r\n<h3>Om moduler og funktioner</h3>\r\n<div class=\"text editorArea\">\r\n<div>Den grundl&aelig;ggende beslutning, n&aring;r man v&aelig;lger CMS, er om man skal have en standardiseret, modulbaseret platform eller en udviklingsplatform. dd</div>\r\n<div><br />\r\nTuksi er en udviklingsplatform og kan derfor blive til pr&aelig;cis den l&oslash;sning, du har brug for. Det er dog vores erfaring, at der er elementer i et website, de fleste kunder har brug for, og derfor har Tuksi da ogs&aring; en r&aelig;kke standardmoduler og -funktioner. Dem kan man komme rigtig langt med.</div>\r\n</div>\r\n</div>\r\n<div class=\"mTextImageLeft\">\r\n<h3>Tuksis l&oslash;sninger er lidt smartere ... ...</h3>\r\n<div class=\"text editorArea\">\r\n<p>Samtidig pr&oslash;ver vi typisk at lave standardfunktionerne lidt smartere end de f&aring;s andre steder.</p>\r\n<div>Vores billededitor f.x. Som det eneste CMS vi kender, kan man i Tuksi sk&aelig;re sin billeder til inde i CMS&rsquo;et &ndash; s&aring; man springer langsommelige man&oslash;vrer i billedbehandlingsprogrammer over. Og slipper for at k&oslash;be dyre licenser, til programmer man ellers ikke har brug for.</div>\r\n<div>&nbsp;</div>\r\n<p>Vi har ogs&aring; optimeret vores nyhedsbrevsmodul, s&aring; vi er stensikre p&aring;, at det ser ordentligt og rigtigt ud uanset hvilket e-mail program, det vises i. Og s&aring; har det en drabeligt god statistikfunktion som kan fort&aelig;lle, hvor mange af modtagerne der faktisk l&aelig;ser nyhedsbrevet, og