,'frontend'),(414,17,78,83,0,NULL,NULL,NULL,200,NULL,NULL,NULL,'2009-02-13 13:44:35',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,90,'frontend'),(516,3,95,13,1,'',NULL,NULL,200,NULL,NULL,'cmstree:82','2009-02-18 13:30:54','Se flere referencer her...',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,16,'frontend'),(513,18,9,13,1,'',NULL,'<h3><span style=\"color: darkgreen\"><strong>Hjemmesider uden hovedpine</strong></span></h3>\r\n<div class=\"text editorArea\">&nbsp;</div>\r\n<div class=\"text editorArea\">Tuksi er et syv &aring;r gammelt Content Management System (CMS) udviklet for at opfylde webkunders konkrete &oslash;nsker og behov.</div>\r\n<div class=\"text editorArea\">&nbsp;</div>\r\n<div class=\"text editorArea\">Kort fortalt er Tuksi en udviklingsplatform for websites af enhver art og st&oslash;rrelse, som kan give dig pr&aelig;cis den l&oslash;sning, du har brug for. Det er baseret p&aring; kendte og &aring;bent tilg&aelig;ngelige teknologier, s&aring; man som kunde ikke er bundet til en bestemt leverand&oslash;r.</div>\r\n<div class=\"text editorArea\">&nbsp;</div>\r\n<div class=\"text editorArea\">Tuksis udvikling er baseret p&aring; at lytte til kunderne, og det b&oslash;r dit valg af CMS ogs&aring; v&aelig;re. Tuksibrugeres vurdering af produktet, kan hj&aelig;lpe dig med at beslutte, om Tuksi er en mulighed for din organisation. Det er tit en bedre id&eacute; at lytte til s&aelig;lgerens kunder end til s&aelig;lgeren selv&hellip;</div>',100,NULL,NULL,'','2009-02-18 13:26:04','','1','Hjemmesider uden hovedpine',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,16,'frontend'),(514,24,9,13,1,'',NULL,'<div><strong><span style=\"color: white\"><sup>11.07.2008</sup></span></strong> <span style=\"color: black\">\r\n<div><u><strong>Tuksi 4 release - Danmarks hurtigste og mest fleksible php udviklingsplatform</strong></u><strong> </strong></div>\r\n<div>&nbsp;</div>\r\n<div>Hurtigere, endnu mere skalerbar og nemmere at customize. Det er hvad den seneste udgave af content management systemet Tuksi er. Opgraderingen af Tuksi 3 til Tuksi 4 har betydet en komplet omskrivning af kernen i Tuksi. <br />\r\n<br />\r\nOpdateret og med en optimeret teknisk opbygning giver Tuksi 4 reduceret udviklingstid for kunderne, som g&oslash;r udvikling af tilpasning af avancerede online l&oslash;sninger b&aring;de billigere at bygge - og vedligeholde. Brugerfladen er ogs&aring; blevet re-designet, s&aring; det - om muligt - er blevet endnu lettere at v&aelig;re bruger af Tuksi.<br />\r\n<br />\r\n<em><strong>Med Tuksi 4 f&aring;r man nu et 100% stringent system - og det er stadig den eneste komplette, open-source, kommercielle udviklingsplatform p&aring; markedet.</strong></em></div>\r\n</span></div>',100,NULL,NULL,'','2009-02-18 13:26:42','','1','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,16,'frontend'),(512,28,94,13,1,NULL,NULL,'\"... relevant at fremhæve Tuksi CMS systemet, der er særdeles brugervenligt og overskueligt.\"  Se mere',100,'pg_content/512_image_4124.jpg|her',NULL,'cmstree:139','2009-02-18 13:24:30','her.','1',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,16,'frontend'),(382,5,98,186,1,'Lerum arfir lafir',NULL,NULL,400,NULL,NULL,NULL,'2009-02-10 12:59:57',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,205,'frontend'),(527,17,97,186,1,'',NULL,NULL,100,'pg_content/527_image_5212.jpg',NULL,NULL,'2009-02-18 14:15:59','','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,205,'frontend'),(627,17,4,310,0,'',NULL,NULL,100,NULL,NULL,'','0000-00-00 00:00:00',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,1,1,0,'frontend'),(629,17,4,311,0,'',NULL,NULL,100,NULL,NULL